INSERT INTO `oxartextends` VALUES ('05833e961f65616e55a2208c2ed7c6b8','','','','','2016-07-19 14:11:15'),('05848170643ab0deb9914566391c0c63','<div class=\"product_title_big\">\r\n<h2>ION Madtrixx Kite Waist 2011</h2></div>\r\n    Neues Freestyle Trapez mit einer schlank\r\ngeschnittenen Outline und Neopren-Schutzkissen innen. Dank der\r\nelastischen Ausschnitte im hinteren Teil des Trapezes bietet es ein\r\nMaximum an Flexibilitt. Die neue Kontur Form mit Wrap Tec garantiert\r\neine perfekte Passform.<br />\r\n<br />\r\n<div><strong>Ausstattungsmerkmale:</strong></div>\r\n<ul>\r\n<li>Hip Protection<br />\r\n  Die Double-Layer-Schaumstoff-Polsterung schtzt die Knochen und alle\r\nanderen ungeschtzten Teile in diesem Bereich. Besonders, wenn der\r\nKrper seitlich gebeugt ist.</li>\r\n<li>Cross Link Webbing<br />\r\n  Normalerweise enden die Gurtbandenden irgendwo hinter der Schnalle.\r\nEin ununterbrochenes Gurtband entlang der Rckseite des Trapezes\r\ngarantiert eine bessere Kraftverteilung</li>\r\n<li>Internal Flex Belt<br />\r\n  Flexibler Hftgurt , sichert einen festen und bequemen Sitz des Trapezes</li>\r\n<li>Handle Pass Leash Slider<br />\r\n  Ein kleiner Metallring lsst die Leash entlang der Rckseite des Trapezes gleiten und macht Handle Pass Tricks einfacher</li>\r\n<li>Push Button Spreader Bar<br />\r\n  Der Druckknopf untersttzt die schnelle Montage des Trapezes. Es\r\nbesteht keine Notwendigkeit, alle Klettbnder an den&nbsp; Schnallen zu\r\nmontieren. Schlie einfach den Metallring in der Spreader Bar, pass das\r\nGurtband an und los geht\'s.</li>\r\n<li>Belt Garage<br />\r\n  Verhindert ein Herumfliegen des Gurtbandes</li>\r\n<li>Protection Pads<br />\r\n  Eine solide, neoprengepolsterte Platte, hlt den Trapezhaken vom Krper fern</li>\r\n<li>Contour shape<br />\r\n  vorgeformte Konstruktion</li>\r\n<li>Elasto Tec<br />\r\n  Flexible Ausschnitte in Hfttrapezen sorgen fr ein Maximum an&nbsp; Flexibilitt im hinteren Teil des Trapezes.</li>\r\n<li>Weicher Rand des Trapezes</li>\r\n<li>Support Cushion</li>\r\n<li>Twister</li>\r\n<li>Wrap Tech<br />\r\n  Vorgeformte Trapezkonstruktion, die sich besser am Krper anpasst</li></ul>','<div class=\"product_title_big\">\r\n<h2>ION Madtrixx Kite Waist 2011</h2></div>\r\n<p>New freestyle harness with a lean cut outline and a neoprene inside airbag. Thanks to the elastic cutaways at the rear part of the harness provides a maximum of flexibility. The new contour form with Wrap Tec guarantees a perfect fit.</p><br />\r\n<div><strong>Fitting attributes:</strong></div>\r\n<ul>\r\n<li>Hip Protection<br />\r\nThe double layer foam padding protects the bones and all unprotected parts in this area, especially if the body is flexed to the side.</li>\r\n<li>Cross Link Webbing<br />\r\nUsually, the belt ends somewhere behind the buckle. A belt without cease along the rear side of the harness guarantees a better load balancing.</li>\r\n<li>Internal Flex Belt<br />\r\n  Flexible hip belt. Backs a safe, straight and comfortable seat of the harness.</li>\r\n<li>Handle Pass Leash Slider<br />\r\nA small ring of metal can slip the leash along the back of the harness and makes handle pass tricks easier.</li>\r\n<li>Push Button Spreader Bar<br />\r\nThe push button supports the quick assembly of the harness. There is no need to assemble all velcro strips at the buckle. Simply close the metal ring in the spreader bar, adjust the belt and - here we go!</li>\r\n<li>Belt Garage<br />\r\nPrevents from loose tottering of the belt.</li>\r\n<li>Protection Pads<br />\r\nA solid, neoprene padded board that keeps the harness hook away from the body.</li>\r\n<li>Contour shape<br />\r\n  preformed construction</li>\r\n<li>Elasto Tec<br />\r\nFlexible cutaways in hip harness care for a maximum of flexibility in the rear part of the harness.</li>\r\n<li>Soft edges&nbsp; </li>\r\n<li>Support Cushion</li>\r\n<li>Twister</li>\r\n<li>Wrap Tech<br />\r\npreformed construction of the harness that better fits the body.</li></ul>></p>','','','2016-07-19 14:11:15'),('0584e8b766a4de2177f9ed11d1587f55','<div class=\"product_title_big\">\r\n<h2>Klebeband Dacron Kitefix</h2></div>\r\n<div class=\"product_text3\">\r\n<div><span>Das selbstklebende Dacron\r\nKlebeband ist ideal, um eine GluFix und FiberFix Reparatur an der\r\nLeading Edge oder den Struts Ihres Kites zu verstrken.  Sie sind gerade\r\n vom Wasser gekommen und haben einen Riss im Tuchmaterial Ihres Kites\r\nentdeckt? Verwenden Sie das Dacron Klebeband, um eine schnelle,\r\ntemporre Reparatur durchzufhren. Erhltlich in wei, schwarz, grn,\r\nrot und blau.</span></div>\r\n<div><span>&nbsp;</span></div>\r\n<div><span>Jede Rolle ist ca. 5cm breit und ca. 152cm lang.</span></div>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><span> <br />\r\n</span></p></div>','<div class=\"product_title_big\">\r\n<h2>Sticky Tape Dacron Kitefix</h2></div>\r\n<div class=\"product_text3\">\r\n<div><span>The self-adhesive Dacron\r\ntape is ideal to boost GluFix and FiberFix repairs at the leading edge or the struts of your kite. You just came from water and detected a tear in the drapery of your kite? Use Dacron sticky tape for a quick and temporary repair. We sell it in white, black, green, red and blue.</span></div>\r\n<div><span>&nbsp;</span></div>\r\n<div><span>Each roll is about 5 cm of width and approx. 152 cm long.</span></div>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>></p></div>','','','2016-07-19 14:11:15'),('058c7b525aad619d8b343c0ffada0247','','','','','2016-07-19 14:11:15'),('058de8224773a1d5fd54d523f0c823e0','<p>\r\n<div class=\"product_title_big\">\r\n<h2>Cabrinha Caliber 2011 </h2></div>\r\n    Das Caliber meint es ernst mit Freestyle\r\nund Freeride. Wenn du schnell und hart kiten willst, dann ist das\r\nCaliber passend fr dich!<br />\r\n<br />\r\n   Das Caliber hat eine flachere Rockerlinie als das Custom, was es\r\nknackig und lebhaft macht. Es beschleunigt sehr schnell und behlt den\r\nSpeed auch durch Windlcher hindurch. Die Outline des Caliber und der\r\nFlexverlauf bringen dir hrtesten Pop beim Absprung, egal ob du unhooked\r\n oder hooked fhrst. Das quadkonkave Unterwasserschiff gibt dir\r\nmaximalen Grip bei Starkwind und in kabbeligem Wasser.<br />\r\n<br />\r\n<div><strong>Ausstattungsmerkmale:</strong></div>\r\n<ul>\r\n<li>neue unidirektionale Carbonlage fr krftigen Pop und schnelle Rckmeldung</li>\r\n<li>unterschiedliches 3D Topsheet Design je Gre, fr konstanteren Flex und Pop</li>\r\n<li>digital gedruckte Oberflche mit metallic Effekt, digital bedruckte Basis fr lngere Haltbarkeit</li>\r\n<li>24&#8216;&#8216;(61cm) / 26&#8216;&#8216; ( 66cm) / 28&#8216;&#8216; (71cm) Stand-Optionen<br />\r\n</li></ul>\r\n<div><strong>Lieferumfang:</strong></div><br />\r\n   Alle Boards werden mit Finnen, Finnenschrauben und Grab Handle (+ dazugehrige Schrauben) geliefert.<br />\r\n<br />\r\n<div><strong>Gren:</strong></div><br />\r\n   127 x 38<br />\r\n   130 x 40<br />\r\n   133 x 41<br />\r\n   136 x 42<br />\r\n   139 x 43</p>\r\n<p> </p>','<div class=\"product_title_big\">\r\n<h2>Cabrinha Caliber 2011 - Board only</h2></div>Caliber means business with Freestyle and Freeride. If you want to kite fast and hard Caliber is for you!<br />\r\n<br />Caliber has a more flat rocker line than Custom that makes it firm and agile. It accelerates very quickly and keeps the speed even through wind holes. The outline of Caliber and the flex gradient will bring you hardest pop during the jump no matter if you go hooked or unhooked. The quad concave underwater hull gives you a maximum grip at strong wind and in choppy water.\r\n<div>&nbsp;</div>\r\n<div>\r\n<div><strong>Fitting attributes:</strong></div>\r\n<ul>\r\n<li>a new unidirectional carbon layer for a strong pop and quick response</li>\r\n<li>different 3D top sheet design by size for more constant flex and pop</li>\r\n<li>a digitally printed surface with metallic effect: a digitally printed basis for longer life period</li>\r\n<li>24&#8216;&#8216; (61 cm) / 26&#8216;&#8216; (66 cm) / 28&#8216;&#8216; (71 cm) stand option<br />\r\n</li></ul>\r\n<div><strong>Purchased parts package:</strong></div><br />\r\nAll boards are delivered with fins, fin screws and grab handle (+ screws).<br />\r\n<br />\r\n<div><strong>Sizes:</strong></div></div>\r\n<div><br />\r\n   127 x 38<br />\r\n   130 x 40<br />\r\n   133 x 41<br />\r\n   136 x 42<br />\r\n   139 x 43</div>\r\n<p>&nbsp;</p>></p>','','','2016-07-19 14:11:15'),('058e613db53d782adfc9f2ccb43c45fe','<p>\r\n<div class=\"product_title_big\">\r\n<h2>O\'Brien Decade CT Boot 2010</h2></div>\r\n    Die Decade Pro Bindung ist nicht nur\r\n Close-Toe Boots mit hammer Style, sondern es war das Ziel den Komfort\r\nvon normalen Boots in eine Wakeboard-Bindung einzubringen, dabei\r\nleichtgewichtig zu bleiben, und damit perfekte Performance auf dem\r\nWasser zu ermglichen.<br />\r\n<br />\r\n  Die Wakeboard-Bindung ist in der Gre gleich bleibend, gibt also im\r\nLaufe der Zeit nicht nach und sitzt somit wie ein perfekter Schuh. Ein\r\nergonomisches und stoabsorbierendes Fussbett sorgt fr weiche\r\nLandungen.</p>\r\n<p> </p>','<div class=\"product_title_big\">\r\n<h2>O\'Brien Decade CT Boot 2010</h2></div>The Decade Pro binding is not only a close-toe boot in a very fancy style. The aim was, to integrate the comfort of regular boots into a wake board binding, to stay lightweight and to reach a perfect performance at the water.\r\n<div>&nbsp;</div>\r\n<div>The wake board binding keeps it\'s size, doesn\'t ease off in a time and fits like a perfect shoe. The ergonomic and absorbing insole provides soft landings.</div>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>></p>','','','2016-07-19 14:11:15'),('09602cddb5af0aba745293d08ae6bcf6','','','','','2016-07-19 14:11:15'),('09620040146118fbc4b7eef6a0faf072','','','','','2016-07-19 14:11:15'),('0962081a5693597654fd2887af7a6095','','','','','2016-07-19 14:11:15'),('0963c9792aea84adff1d2ef8aa4a7679','','','','','2016-07-19 14:11:15'),(