verschlu ber der Hosentasche, geradem und engem Beinschnitt.<br />\r\n<br /><strong>100% kologisch angebaute Baumwolle, 100% Fair Trade.</strong><br />\r\n<br /><br />\r\n</div>','<p><span id=\"goog-gtc-unit-24\" class=\"goog-gtc-unit\"><span dir=\"ltr\" class=\"goog-gtc-translatable goog-gtc-from-human\">A trendy and fresh men\'s jeans by Kuyichi.&nbsp;</span></span><span id=\"goog-gtc-unit-25\" class=\"goog-gtc-unit\"><span dir=\"ltr\" class=\"goog-gtc-translatable goog-gtc-from-human\">Casual jeans with a zipper over the pockets and straight, tight legs.</span></span></p>\r\n<p><strong>100% organic cotton, 100% Fair Trade.</strong></p>\r\n','','','2016-07-19 14:11:15'),('943ef11c043560fda5ab26c676d2b4b7','','','','','2016-07-19 14:11:15'),('943f0b4f48f70554aba6df096cf77ecc','','','','','2016-07-19 14:11:15'),('943f54f183ff92a368fabdafe7cb22f9','','','','','2016-07-19 14:11:15'),('943f5666b61225cd2db39d8a0e60c75c','','','','','2016-07-19 14:11:15'),('943f56ef82206ecf941b0d2c7e05ed07','','','','','2016-07-19 14:11:15'),('943f64413ada941e06a13d7da52b32e3','','','','','2016-07-19 14:11:15'),('943f86c3b0d2349a5564a95b6d90c818','','','','','2016-07-19 14:11:15'),('943ff9e0768e215c57c95b15459a5645','','','','','2016-07-19 14:11:15'),('adc5ee42bd3c37a27a488769d22ad9ed','<div class=\"product_title_big\">\r\n<h2>NPX Vamp Semidry 5/4/3 GBL 2010</h2></div>\r\n<div class=\"product_text3\">\r\n<div>Wie der Cult fr Mnner, ist der\r\nVamp ein preiswerter Neoprenanzug fr Frauen, der trotzdem den NPX\r\nAnsprchen gerecht wird. Ein aufflliges Design soll vor allem auch die\r\njngere Generation ansprechen. <br />\r\n<br /><strong>Konstruktion:</strong><br />\r\n<ul>\r\n<li>40% Apex Neopren an den Schulter und Unterarmbahnen</li>\r\n<li>60% Dura Neopren im&nbsp; restlichen Anzug</li>\r\n<li>GBL Nhte<br />\r\n</li></ul><strong>Ausstattungsmerkmale:</strong><br />\r\n<ul>\r\n<li>Charcoal Kontrast Naht</li>\r\n<li>Elastische Schlaufe fr den Schlssel an der inneren Rckenbahn</li>\r\n<li>Klettband zum leichteren Ziehen des Reiverschlusses</li>\r\n<li>TPU Knie Pads</li>\r\n<li>Cinch Loop Beinabschlsse</li>\r\n<li>Abnehmbare Cinch Loop Beinabschlsse&nbsp;</li>\r\n<li>Chromoplast Aufdruck</li></ul></div></div>','<div class=\"product_title_big\">\r\n<h2>NPX Vamp Semidry 5/4/3 GBL 2010</h2></div>\r\n<div class=\"product_text3\">\r\n<div>Analogue to the cult for men, the \"Vamp\" is a reasonably prices wetsuit for women that anyway fits the NPX needs. The flashy design is perfect to address especially the younger generation.</div>\r\n<div><br />\r\n<strong>Design:</strong><br />\r\n<ul>\r\n<li>40% Apex Neoprene at the shoulders and the arm-beds</li>\r\n<li>60% Dura Neoprene at the rest of the suit</li>\r\n<li>GBL stitchings<br />\r\n</li></ul><strong>Fitting attributes:</strong><br />\r\n<ul>\r\n<li>Charcoal contrast stitchings</li>\r\n<li>Elastic loop for the key at the inner back drapery</li>\r\n<li>Velcro for smooth zip drawing</li>\r\n<li>TPU knee pads</li>\r\n<li>Cinch Loop leg endings</li>\r\n<li>Removable Cinch Loop leg endings&nbsp;</li>\r\n<li>Chromoplast printing</li></ul>></p></div></div>','','','2016-07-19 14:11:15'),('adc920f4cbfa739803058c663a4a00b9','<div class=\"product_title_big\">\r\n<h2>Flyboards Flywave 2010</h2></div>\r\n<div class=\"product_text3\"></div>\r\n<div>\r\n<div><strong>Form und Eigenschaften:</strong><br />\r\n</div></div>\r\n<div>\r\n<div>&nbsp;</div></div>\r\n<div>\r\n<div>Dieses Board wurde in Zusammenarbeit mit dem niederlndischen Wave-Guru Ruud Overwater entwickelt, und profitiert von mehr als 6 Jahren Erfahrung im Wellenreiten. Es ist vergleichsweise einfach im Handling und verleiht ein angenehmes Surfgefhl. Das Flywave ist besonders gut fr kabbeliges Wasser und kurze Wellen geeignet. Ein Setup mit 3 Finnen (6cm) am Heck sowie 2 kleineren Finnen im Bugbereich sorgen fr die ntige Stabilitt. </div></div>\r\n<div>\r\n<div>\r\n<div>\r\n<div>&nbsp;<br />\r\n<br /><strong>Konstruktion:</strong><br />\r\n</div></div></div>\r\n<div>\r\n<div>&nbsp;</div></div>\r\n<div>\r\n<div>\r\n<div>Der Kern des Flywave ist aus leichtem aber sehr langlebigem Paulownia Holz. Durch den Einsatz dieses Materials gehren gebrochene Boards der Vergangenheit an. Doppelt verstrkter Bug- und Heckbereich sowie Polyethylene-Schienen verleihen dem Board Stabilitt und den ntigen Schutz. &nbsp; </div></div>\r\n<p>Insgesamt 18 Gewindeeinstze sorgen fr die optimale Standeinstellung auf dem Board, egal ob goofy, regular, straight oder wide.&nbsp;</p>\r\n<div>\r\n<div><br />\r\n<strong>Details:</strong><br />\r\n<ul type=\"disc\">\r\n<li class=\"MsoNormal\">Gre: 145x39 cm</li>\r\n<li class=\"MsoNormal\">Gewicht: 3,06 kg<br />\r\n</li>\r\n<li class=\"MsoNormal\">Stand: 56cm - 60\r\ncm</li>\r\n<li class=\"MsoNormal\">Holz/Schaum-Kern</li>\r\n<li class=\"MsoNormal\">3x 6cm G10<br />\r\n  2x 4,5cm G10</li></ul></div></div></div></div>','<div class=\"product_title_big\">\r\n<h2>Flyboards Flywave 2010</h2></div>\r\n<div class=\"product_text3\">\r\n<div><strong>The Shape and Characteristic:</strong><br />\r\n<br />\r\n   All new for 2010 is the addition of the FlyWave S to the Flyboards\r\nrange. Designed in association with Dutch wave-guru Ruud Overwater, who\r\nhas put over 6 years of wave riding experience into this board. The\r\nFlyWave S is a mutant style board for the rider who wants to ride the\r\nwaves powerful with a board that has a surf feeling, but still wants to\r\nkeep the advantages of a twin tip and is very easy to ride. The FlyWave S\r\n works really well in choppy and short waves (big or small), when\r\ntraditional surfboards are very uncomfortable. Flip nose and -tail are\r\nintegrated in the FlyWave S, creating a board that is very resistant to\r\nspray and is not prone to dive into a wave. The FlyWave has a 6cm\r\ntri-fin setup on the tail and two smaller fins at the nose, this way the\r\n board can still be ridden in both directions. The full wood core gives\r\nthe FlyWave S extreme durability; kite loops can now be performed\r\nwithout worries!<br />\r\n<br /><strong>Flex/Scoop-Rocker:</strong><br />\r\n<br />\r\n   The Scoop-Rocker line of the FlyWave is self adjusting from under- to overpowered conditions in parts of a second.<br />\r\n<br /><strong>Mutant Shape:</strong><br />\r\n<br />\r\n   With a pronounced riding feeling towards one side, due to the outline\r\n combined with the tri-fin setup the FlyWave S gives superb grip in the\r\nwaves. But still can be ridden in each direction, no jibing necessary!\r\nThe flat bottom creates a board that is fast and easy to ride, while the\r\n Flip nose and &#8211;tail give the FlyWave S comfort and control in waves and\r\n choppy conditions.<br />\r\n<br /><strong>The Construction:</strong><br />\r\n<br />\r\n   The core of the FlyWave S is made out of light, but super durable\r\nPaulownia wood. Since Flyboards integrated this core material, broken\r\nboards have been a thing of the past.<br />\r\n   The inserts are double reinforced. Thin ABS rails and tips made out\r\nof polyethylene are used to protect the board and to increase the flex\r\nin the tips. Flyboards use a 3 Dimensional construction, to be able to\r\nadd the flex to the sides of the tips instead of only the whole tip. The\r\n weight of the FlyWave S will surprise you; it weighs almost the same as\r\n a FlyRadical M, giving you an even more enjoyable session on and off\r\nthe water!<br />\r\n<br />\r\n   With 18 inserts your optimum stance can always be created, whether it will be goofy, regular, straight or wide stance.<br />\r\n<br /><strong>Specs:</strong><br />\r\n<ul type=\"disc\">\r\n<li class=\"MsoNormal\">Size: 145x39 cm</li>\r\n<li class=\"MsoNormal\">Weight: 3,06 kg<br />\r\n</li>\r\n<li class=\"MsoNormal\">Stance: 56cm - 60\r\ncm</li>\r\n<li class=\"MsoNormal\">Wood/Foam Core</li>\r\n<li class=\"MsoNormal\">3x 6cm G10<br />\r\n  2x 4,5cm G10</li></ul>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>></p></div></div>','','','2016-07-19 14:11:15'),('adcb9deae73557006a8ac748f45288b4','<div class=\"product_title_big\">\r\n<h2>Helm AHM 5000</h2></div>\r\n<div>Ein Klassiker unter den Wassersporthelmen. Hochwertiges Finish und perfekte Optik. </div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Features:</strong></div>\r\n<div>\r\n<ul>\r\n<li>schlagfeste Schale<br />\r\n</li>\r\n<li>geprfter CE 1385 Standard</li>\r\n<li>individuell verstellbar<br />\r\n</li>\r\n<li> Schaumpolster<br />\r\n</li></ul></div>\r\n<div><strong>Gren:</strong><br />\r\n</div>\r\n<div>\r\n<ul>\r\n<li>Einheitsgre<br />\r\n</li>\r\n<li>Polstereinlagen in den Gren S, M und L im Lieferumfang enthalten<br />\r\n</li>\r\n<li>Kopfumfang (min/max)<br />\r\n         53,34 - 60,32cm</li></ul></div>','<div class=\"product_title_big\">\r\n<h2>Shred Ready AHM 5000</h2></div>\r\n<div>\"Plastic price without the plastic\r\nlook and feel. That\'s what makes this new line so appealing...The\r\ngraphics make the helmet look like a more expensive carbon or composite\r\nmodel...\" - Paddler Magazine, July/Aug 2000.</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Features:</strong></div>\r\n<div>\r\n<ul>\r\n<li>Hard ABS abrasion resistant shell</li>\r\n<li>CE 1385 Standard; International Standard for whitewater headgear.</li>\r\n<li>Faux Carbon Graphic., and Solid Colors</li>\r\n<li>Soft tubed nylon webbing</li>\r\n<li>Removable Compression Molded Ear Flaps</li>\r\n<li>Stainless steel rivets and burrs to stop the corrosion</li>\r\n<li>Easily adjustable four-point retention system</li>\r\n<li>Dura-Flex fastners, adjusters, and stops</li></ul></div>\r\n<div><strong>Sizes:</strong><br />\r\n</div>\r\n<div>\r\n<ul>\r\n<li>One Size<br />\r\n             Small, Medium and Large fitting pads are included with each helmet for a custom fit</li>\r\n<li>Head Circumference (min/max)<br />\r\n         21\'\' - 23 3/4\'\'<br />\r\n         53,34 - 60,32cm<br />\r\n</li></ul></div>\r\n<p><font size=\"3\"><span>To determine your head circumference, simply\r\nmeasure the circumference of your head at the widest part. Shred Ready\r\nhelmets are engineered to fit a wide range of head sizes.</span></font></p>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>></p>','','','2016-07-19 14:11:15'),('b56164c54701f07df14b141da197c207','<div class=\"product_title_big\">\r\n<h2>Liquid Force Transit Boot 2010</h2></div>\r\n<div><strong>&nbsp;</strong></div>\r\n<div><strong>Eigenschaften:</strong></div>\r\n<ul>\r\n<li> Neues IP Chassis fr 2010!<br />\r\nZahlreiche Einstellmglichkeiten sorgen fr einen sicheren Stand. </li>\r\n<li>Liquid Fit&#8482; Technology<br />\r\n</li>\r\n<li>Pillow Top Liner<br />\r\n Extra weiche Einlagen bieten hohen Tragekomfort auch bei langen Marathon-Sessions. </li>\r\n<li>EZ Glide Lacing<br />\r\n Speziell entwickelte Schnrsenkel und Schlaufen sorgen fr perfekten Halt und einfaches Handling. </li>\r\n<li>LF Exclusive, Full Stretch Comfort Gusset<br />\r\n Ermglicht einfaches und schnelles Einsteigen in den Schuh und minimiert unangenehme Druckstellen im Fubereich. Passt sich perfekt der Fuform an. </li>\r\n<li>Perfect-Fit Design (5-7, 7-8, 8-9, 9-10, 10-11, 11-12, 12-13)</li></ul>\r\n<p></p>','<div class=\"product_title_big\">\r\n<h2>Liquid Force Transit Boot 2010</h2></div>\r\n<div><strong>&nbsp;</strong></div>\r\n<div><strong>Features:</strong></div>\r\n<ul>\r\n<li> IP Chassis&#8230; New for 2010!<br />\r\n Reliable, hassle-free adjustment&#8230; Angle Locks hold strong and allow for easier stance adjustment than ever before.</li>\r\n<li>Liquid Fit&#8482; Technology<br />\r\n No heat molding necessary. Exclusive blend of ultralight foam that\r\nforms to your foot after a few rides. Mold your boots to your riding\r\nstance rather than a relaxed position in a shop.</li>\r\n<li>Pillow Top Liner<br />\r\n Extra soft padding where you need it most. Eliminates shin and calf discomfort from those marathon sessions.</li>\r\n<li>EZ Glide Lacing<br />\r\n Specially designed laces and lace loops work together to lock you in and let you out of the boot quickly and easily.</li>\r\n<li>LF Exclusive, Full Stretch Comfort Gusset<br />\r\n Allows for easy entry without utilizing any mechanical pieces and\r\neliminates pressure points over the top of any foot. Makes every boot\r\nfeel like it&#8217;s been custom fit to your foot.</li>\r\n<li>Perfect-Fit Design (5-7, 7-8, 8-9, 9-10, 10-11, 11-12, 12-13)<font size=\"1\"><br />\r\n<font size=\"3\">Available in a wide range of sizes to find the perfect fitting boot for your foot.</font></font></li></ul>></p>','','','2016-07-19 14:11:15'),('b56369b1fc9d7b97f9c5fc343b349ece','<div class=\"product_title_big\">\r\n<h2>Core Kiteboarding GTS - nur Kite</h2></div>\r\n<div class=\"product_text3\">\r\n<div>Zwei Jahre nach der Einfhrung des\r\nlegendren GT stellt CORE den schnellsten und sportlichsten Kite vor,\r\nden sie&nbsp; jemals gebaut haben. Der legendre Allesknner mit extra\r\nStrken in Freestyle, New School und Wave: Der neue GTS. </div>\r\n<div>&nbsp;</div>\r\n<div>Der neue CORE GTS hat alle Strken eines ALL-IN-ONE Kites,\r\nzustzlich hat ihm das CORE Team noch einige radikalere Gene eingeimpft.\r\n Das Ergebnis ist ein Delta Design mit radikalen C-Kite Eigenschaften\r\nfr Kiteloops, Unhooked Tricks und das direkteste Bargefhl. Durch mehr\r\nC-Shape erhlt der GTS eine entsprechend przise Lenkung. Neben den\r\nAllround Eigenschaften orientiert sich der GTS zustzlich am\r\nprogressiven Freestyle- und New-School-Fahrer, hooked und unhooked, der\r\nden Kite aggressiver ansprechen mchte. Insbesondere Wellenreiter werden\r\n Dank der perfekten Lenkbarkeit im depowerten Zustand auf ihre Kosten\r\nkommen.</div>\r\n<div>&nbsp;</div>\r\n<div>Durch das uerst direkte Barfeeling und die sehr explosive\r\nKraftentfaltung erhlt der GTS enorm viel Potential fr hchste\r\nSprungpower in mittleren und hheren Windbereichen. </div>\r\n<div>&nbsp;</div>\r\n<div><strong>Bewhrte CORE Technologie </strong></div>\r\n<div>\r\n<ul>\r\n<li>CORE Kites sind dafr bekannt, ber die qualitativ hochwertigsten\r\nMaterialien zu verfgen. Nur auserwhlte Tuche werden verwendet.</li>\r\n<li>In der Produktion, in der exklusiv nur CORE&nbsp; Tubekites herstellt, ist eine kontinuierliche Qualitt gewhrleistet.</li>\r\n<li>Smtliche Leinen und Rollen am Kite sind &#8222;Made in Germany&#8220;.</li>\r\n<li>Allein die Flugleinen der CORE ESP Control Bar verfgen ber eine\r\nBruchlast von jeweils 368 kg bei nur 1,8 mm Durchmesser und sind\r\nbesonders bedienerfreundlich beim Auslegen.</li>\r\n<li>Der GTS hat ein neues One-Pump System: Der Schlauch liegt stromlinienfrmig und servicefreundlich eng am Tuch.</li></ul></div>\r\n<div><strong>Facts</strong></div>\r\n<div>\r\n<ul>\r\n<li>STRAIGHT SEGMENT POWERSTEERING<br />\r\n  Untersttzt wird das sofortige Umsetzen des Lenkbefehls durch das\r\n&#8222;Straight Segment Powersteering Tip&#8220; (SSP): Das gerade Segment zwischen\r\nder Anknpfung der Steuerleine und der hintersten Waageleine setzt\r\nLenkimpluse ohne Energieverluste um.<br />\r\n  Unhooked verhlt sich der GTS stabil wie ein traditioneller C-Kite.\r\nDer Wellenliebhaber wird seine Agilitt und Direktheit zu schtzen\r\nwissen.</li>\r\n<li>CORE INTELLIGENT TRIM SYSTEM<br />\r\n  Eine weitere Neuerung ist das &#8222;CORE Intelligent Trim System&#8220; (CIT),\r\nmit dem der Fahrer die Barrckmeldung und Drehgeschwindigkeit\r\nindividuell einstellen kann. Die Drehgeschwindigkeit lsst sich von easy\r\n handling bis super agil anpassen. Die Barrckmeldung und -krfte lassen\r\n sich ganz einfach von sehr leicht bis stark einstellen.</li>\r\n<li>SICHERHEIT<br />\r\n  Druckloses Auswehen an der virtuellen fnften Leine gewhrt ein hohes\r\nNiveau an Sicherheit in Kombination mit der einzigartigen 100% selbst\r\nausdrehenden ESP Bar.</li></ul></div><strong>Lieferumfang:</strong><br />\r\n<div>\r\n<ul>\r\n<li>Kite-only, incl. Kite-Backpack</li>\r\n<li>RepairKitPro</li></ul><!--[if gte mso 9]>\r\n<xml>\r\n<w:worddocument>\r\n<w:view>Normal</w:view>\r\n<w:zoo