>\r\n<div>Two years after the introduction of the legendary GT, CORE launches the fastest and most sporty kite ever built. The legendary all-rounder with extra strength in Freestyle, New School and Wave: the new GTS. </div>\r\n<div>&nbsp;</div>\r\n<div>The new CORE GTS has all the strengths of an ALL-IN-ONE kite, additionally, the CORE team gave him some more radical genes. The result is a delta design with radical c-kite attributes for kite loops, unhooked tricks and the most direct feeling for the bar. By more c-shape, the GTS gets a precise traction. Besides the all-rounder attributes, the GTS additionally addresses freestyle and new school kiters, hooked and unhooked, that want to give the kite a more aggressive ride. Especially surfers will have fun due to the perfect traction in a depowered state.</div>\r\n<div>&nbsp;</div>\r\n<div>Due to the very direct bar feeling and the very explosive strength, the GTS gets an enormous potental for highest jump power in average and higher flurries.</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Proven CORE Technology </strong></div>\r\n<div>\r\n<ul>\r\n<li>CORE Kites are well known for their highest quality material. Only assorted draperies are used.</li>\r\n<li>Only CORE exclusively produces tube kites and guarantees a continuous high quality.</li>\r\n<li>All leaches and rolls at the kites are \"Made in Germany\".</li>\r\n<li>The flight leaches of the CORE ESP control bar have a breaking load of 368 kg each at only 1.8 mm in diameter. They are especially user friendly at laying-up.</li>\r\n<li>The GTS has got a new one pump system: The tube is streamlined and service friendly tight to the drapery.</li></ul></div>\r\n<div><strong>Facts:</strong></div>\r\n<div>\r\n<ul>\r\n<li>STRAIGHT SEGMENT POWERSTEERING<br />\r\n\"Straight Segment Powersteering Tip\" (SSP) supports the immediate steering command: The straight segment between the tie of the steering leash and the rear balance leash converts steering impulses without any energy loss.</li>\r\n<li>Unhooked, the GTS is as stable as a traditional c-kite. The wave lover will appreciate the agility directness.</li>\r\n<li>CORE INTELLIGENT TRIM SYSTEM<br />\r\nAnother new feature is the &#8222;CORE Intelligent Trim System&#8220; (CIT). Using it, the kiter can adjust the bar response and the rotational speed individually. The rotational speed can be adapted from easy handling to super agile. The bar response can be simply set from soft to heavy.</li>\r\n<li>SECURITY<br />\r\nPressureless blow out at the virtual fifth leash and the inimitable 100% self rotating ESP bar guarantee a high security level.</li></ul></div><strong>Purchased parts package:</strong><br />\r\n<div>\r\n<ul>\r\n<li>Kite-only, incl. kite backpack</li>\r\n<li>RepairKitPro</li></ul><!--[if gte mso 9]>\r\n<xml>\r\n<w:worddocument>\r\n<w:view>Normal</w:view>\r\n<w:zoom>0</w:zoom>\r\n<w:trackmoves/>\r\n<w:trackformatting/>\r\n<w:hyphenationzone>21</w:hyphenationzone>\r\n<w:punctuationkerning/>\r\n<w:validateagainstschemas/>\r\n<w:saveifxmlinvalid>false</w:saveifxmlinvalid>\r\n<w:ignoremixedcontent>false</w:ignoremixedcontent>\r\n<w:alwaysshowplaceholdertext>false</w:alwaysshowplaceholdertext>\r\n<w:donotpromoteqf/>\r\n<w:lidthemeother>DE</w:lidthemeother>\r\n<w:lidthemeasian>X-NONE</w:lidthemeasian>\r\n<w:lidthemecomplexscript>X-NONE</w:lidthemecomplexscript>\r\n<w:compatibility>\r\n<w:breakwrappedtables/>\r\n<w:snaptogridincell/>\r\n<w:wraptextwithpunct/>\r\n<w:useasianbreakrules/>\r\n<w:dontgrowautofit/>\r\n<w:splitpgbreakandparamark/>\r\n<w:dontvertaligncellwithsp/>\r\n<w:dontbreakconstrainedforcedtables/>\r\n<w:dontvertalignintxbx/>\r\n<w:word11kerningpairs/>\r\n<w:cachedcolbalance/></w:compatibility>\r\n<m:mathpr>\r\n<m:mathfont m:val=\"Cambria Math\"/>\r\n<m:brkbin m:val=\"before\"/>\r\n<m:brkbinsub m:val=\"&#45;-\"/>\r\n<m:smallfrac m:val=\"off\"/>\r\n<m:dispdef/>\r\n<m:lmargin m:val=\"0\"/>\r\n<m:rmargin m:val=\"0\"/>\r\n<m:defjc m:val=\"centerGroup\"/>\r\n<m:wrapindent m: