  mso-tstyle-rowband-size:0;\r\n  mso-tstyle-colband-size:0;\r\n  mso-style-noshow:yes;\r\n   mso-style-priority:99;\r\n  mso-style-qformat:yes;\r\n  mso-style-parent:\"\";\r\n    mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n    mso-para-margin-top:0cm;\r\n    mso-para-margin-right:0cm;\r\n  mso-para-margin-bottom:10.0pt;\r\n  mso-para-margin-left:0cm;\r\n   line-height:115%;\r\n   mso-pagination:widow-orphan;\r\n    font-size:11.0pt;\r\n   font-family:\"Calibri\",\"sans-serif\";\r\n mso-ascii-font-family:Calibri;\r\n  mso-ascii-theme-font:minor-latin;\r\n   mso-fareast-font-family:\"Times New Roman\";\r\n  mso-fareast-theme-font:minor-fareast;\r\n   mso-hansi-font-family:Calibri;\r\n  mso-hansi-theme-font:minor-latin;}</style><![endif]-->></p></div></div>','','','2016-07-19 14:11:15'),('b563ab240dc19b89fc0349866b2be9c0','<p><font face=\"Verdana\" size=\"2\"><span>Kuyichi Shirt mit modischem Design.</span></font></p>\r\n<p><font face=\"Verdana\" size=\"2\"><span><strong>100% kologisch angebaute Baumwolle, 100% Fair Trade.</strong></span></font></p>\r\n','<p><span>Cool and casual women\'s half sleeved shirt from Kuyichi.</span></p>\r\n<p><strong><span>100% organic cotton, 100% fair trade.</span></strong></p>\r\n','','','2016-07-19 14:11:15'),('b56597806428de2f58b1c6c7d3e0e093','<div class=\"product_title_big\">\r\n<h2>NKB Evo 2010 - nur Kite</h2></div>\r\n<div class=\"product_text3\">\r\n<div><span>Die perfekte Crossover Waffe zwischen Freeride und Newschool Freestyle.<br />\r\n<br />\r\nDer 2010er Evo hat ein breites Leistungspotential, welches den Anforderungen von nahezu jedem Fahrer gerecht wird.</span><span><br />\r\nDer super stabile Shape, softe, vorhersehbare Flugeigenschaften\r\nund das unglaubliche C-Kite hnliche Feedback an der Bar betteln\r\nfrmlich darum, Sie auszuhngen und mit dem krassen Pop die neuesten New\r\nSchool Manver raus zu hauen. Przise Kiteloops laden Sie ein,\r\nsmtliche Radien und Versionen an Loops auszuprobieren.</span></div>\r\n<div><span>&nbsp;</span></div>\r\n<div><span> Das fantastische Lowend bringt Sie selbst bei wenig Wind\r\nschon frh ins Rutschen. Mit dem Auto Relaunch steht der Evo in wenigen\r\nSekunden wieder im Zenit. Einfach die Bar los lassen, der Kite macht die\r\nganze Arbeit fr Sie.<br />\r\n<br />\r\nNeue Relaunch Bungees vermeiden dass Leinen whrend dem Restart\r\nber die Wing Tips streifen. Viele weitere Konstruktionsdetails\r\nverhindern starke Abnutzung und Risse an Strepunkten. Alle Evos knnen\r\nals 4 sowie als 5- Leiner geflogen werden. Ganz nach persnlicher\r\nVorliebe. Der Evo ist komfortabler denn je.</span><span><br />\r\n<strong><br />\r\nEigenschaften:</strong></span></div>\r\n<div>\r\n<ul>\r\n<li><span>Freeride / Wave Orientierung</span></li>\r\n<li><span><span>loaded 5te Leine Konzept</span></span></li>\r\n<li><span><span>kurzer und direkter Power Stroke/Power Weg</span></span></li>\r\n<li><span><span>Floating Center Strut</span></span></li>\r\n<li><span><span>V-Backleinen System mit integrierten Relaunch Bungees</span></span></li>\r\n<li><span><span>direkte und schnell umgesetzte Lenkbefehle,</span> <span>vorallem in depowertem Zustand</span></span></li>\r\n<li><span><span>Low Drag Design<br />\r\n</span></span> </li></ul> </div>\r\n<div><span><strong>Lieferumfang:</strong></span></div>\r\n<ul>\r\n<li><span>Kite</span></li>\r\n<li><span>Bag</span></li>\r\n<li><span>Repair-Kit</span></li></ul></div>','<div class=\"product_title_big\">\r\n<h2>NBK Evo 2010 - kite only</h2></div>\r\n<div class=\"product_text3\">\r\n<div><span>The perfect cross over weapon between freeride and newschool freestyle.<br />\r\n<br />\r\nThe Evo 2010 has got a wide performance potential that meets the needs of the most kite drivers. It has a super robust shape, soft and predictable flight attributes and an unbelievable response at the bar analogue to a c-kite. You just have to hang it out and try the latest new school maneuver with a starkly pop. Precise kite loops invite you to check out all the radiuses and loops versions.</span></div>\r\n<div><span></span><span>&nbsp;</span></div>\r\n<div><span>The fantastic low end will bring you to an early slide even with a little flurry. With the auto relaunch, the Evo will be back in zenith within seconds. Simply drop the bar - the kite will do the job for you.<br />\r\n<br />New relaunch bungees avoid that the leashes will slip over the wing tips during the restart. Many more construction details prevent from hard wasting and cracks at the stress points. All Evos can be used with four or five leashes depending on your personal preferences. The Evo became more comfortable then ever.</span><span><br />\r\n<strong><br />\r\nAttributes:</strong></span></div>\r\n<div>\r\n<ul>\r\n<li><span>freeride / wave orientation</span></li>\r\n<li><span><span>loaded 5th leash concept</span></span></li>\r\n<li><span><span>short and direct power stroke</span></span></li>\r\n<li><span><span>floating center strut</span></span></li>\r\n<li><span><span>v-back leashes system with integrated relaunch bungees</span></span></li>\r\n<li><span><span>directly and quickly forced steering commands, esp. when depowered</span></span></li>\r\n<li><span><span>low drag design<br />\r\n</span></span> </li></ul> </div>\r\n<div><span><strong>Purchased parts package:</strong></span></div>\r\n<ul>\r\n<li><span>Kite</span></li>\r\n<li><span>Bag</span></li>\r\n<li><span>Repair-Kit</span></li></ul>></p></div>','','','2016-07-19 14:11:15'),('b5666b6d4bcb67c61dee4887bfba8351','<div class=\"product_title_big\">\r\n<h2>Core Kiteboarding Riot XR - nur Kite</h2></div>\r\n<div class=\"product_text3\"><font size=\"1\"><strong></strong></font>Was sofort auffllt, ist die explosive und trotzdem harmonische Kraftentfaltung des RIOT XR mit massivster Hangtime auf Abruf.<br />\r\n<br />\r\n  Dank neu entwickelter Profileffizienz hat sich der Einsatzbereich\r\ndeutlich vergrert: High-End (bis zu 5 Knoten mehr) mit viel Kontrolle\r\nim Grenzbereich bei identischen Eigenschaften im Low-End. Durch den\r\ngeringen Widerstand und fast vollstndig reduzierte Querkrfte hat der\r\nRIOT XR die Eigenschaften zum sehr guten Hhelaufen noch mal enorm\r\nverbessert.<br />\r\n<br />\r\n  Bei Schwachwind wurde die ohnehin schon gute Startbarkeit durch den\r\nneuen Auto-Relaunch und zustzlich noch mal durch die breiteren Tips\r\noptimiert.<br />\r\n<br />\r\n  Noch nie war Freeride so komfortabel.<br />\r\n<br />\r\n<div><strong>Lieferumfang:</strong></div>\r\n<ul>\r\n<li>Kite-only</li>\r\n<li>Kite-Backpack</li>\r\n<li>RepairKitPro</li></ul></div>','<div class=\"product_title_big\">\r\n<h2>Core Kiteboarding Riot XR - Kite only</h2></div>\r\n<div class=\"product_text3\"><font size=\"1\"><strong></strong></font>The explosive and harmonious power of the RIOT XR with a massive hang time on demand attracts immediate attraction.<br />\r\n<br />Thanks to the newly developed profile efficiency, the scope of application expanded immediately: high end (up to five more knots) with much more control in the threshold range at identical attributes at the low end. Due to the small resistance and the nearly completely reduced cross force, RIOT XR could improve the attributes for a very good upwind. In light wind, the already good starting operation due to the new auto relaunch has additionally been optimized by the wider tips.</div>\r\n<div class=\"product_text3\"><br />\r\nFree ride was never so comfortable before.<br />\r\n<br />\r\n<div><strong>Delivery:</strong></div>\r\n<ul>\r\n<li>Kite only</li>\r\n<li>Kite Backpack</li>\r\n<li>RepairKitPro</li></ul>></p></div>','','','2016-07-19 14:11:15'),('b56764137ca959da9541bb28c1987d6c','<div class=\"product_title_big\">\r\n<h2>NKB Rebel 2010 - nur Kite</h2></div>\r\n<div class=\"product_text3\">Von traumhaften, spiegelglatten\r\nFlachwasserpisten bis zu jeder Art von Welle, der Rebel 2010 ist der\r\nultimative all-terrain Freeride Kite Ihrer Trume!<br />\r\n          &nbsp;<br />\r\n          Das uerst smoothe, lebendige Steuerverhalten bietet uerst\r\nviel Rckmeldung, gerade auch dann, wenn der Schirm depowered ist. Dies\r\nmacht den Rebel zum idealen Kite zum Wellen abreiten und ebenso zu einem\r\n tollen Spielzeug in wahrlich allen Bedingungen.<br />\r\n<br />\r\n          Das Loaded 5th Line Design verschafft dem Rebel 2010,\r\nzustzlich zur 100%igen Sicherheit, seinen kurzen und aggressiven Power\r\nWeg, der bis zu 30% krzer ist als bei Kites mit Bridles.<br />\r\n<br />\r\n          Dies bedeutet, dass eine irrsinnig groe Windrange mit nur\r\neinem Kite abgedeckt werden kann, ideal fr die unberechenbaren Tage mit\r\n bigem Wind. Obendrauf sorgt der kurze Power Stroke fr den Luxus des\r\nOn/Off Modus, der gerade down the line in Wellen so wichtig ist. Die\r\nneue Floating Strut, eine Mitteltube die nicht ber die ganze Lnge der\r\nTube mit dem Tuch verbunden ist, ermglicht dass sich das Canopy Tuch\r\noberhalb der Tube frei bewegen kann. Dies ermglicht eine vollere\r\nAnstrmung und eine felsenfeste Position im Zenit in angepowertem\r\nZustand, als auch eine direktere Depower. Die neue &#8222;V\" Verbindung der\r\nBacklines bertrgt die Spannung der Backlines sehr direkt, um ein\r\nsolides Gefhl an der Bar zu erhalten. In Zusammenspiel mit dem neuen\r\nBungee System, werden smtliche unerwnschte Verwicklungen whrend einem\r\n Relaunch unterbunden. Die bekannte, einzigartige Sensibilitt und\r\nSanftheit der Steuerung des Rebels, wurden durch ein zustzliches\r\nSegment in der Leading Edge nochmals unterstrichen. Das ultra cleane,\r\nflatterfreie Canopy Tuch nahe den Tips, sendet Dir durchgehend Signale\r\nund gibt Dir ber die Bar stndig Rckmeldung zu jeder Bewegung des\r\nKites. Also hren Sie auf zu trumen, schnappen Sie sich Ihren Rebel und\r\n rauf aufs Wasser!<br />\r\n<br /><strong>Top Argumente:</strong>\r\n<ul>\r\n<li> Freeride / Wave Orientierung<br />\r\n</li>\r\n<li>loaded 5te Leine Konzept<br />\r\n</li>\r\n<li>kurzer und direkter Power Stroke / Power Weg<br />\r\n</li>\r\n<li>Floating Center Strut<br />\r\n</li>\r\n<li>V-Backleinen System mit integrierten Relaunch Bungees<br />\r\n</li>\r\n<li>direkte und schnelle umgesetzte Lenkbefehle, gerade in depowertem Zusatand<br />\r\n</li>\r\n<li>Low Drag Design<br />\r\n</li></ul>\r\n<div><strong>Lieferumfang:</strong></div>\r\n<ul>\r\n<li>Kite </li>\r\n<li>Bag </li>\r\n<li>Repair-Kit </li></ul></div>','<div class=\"product_title_big\">\r\n<h2>NKB Rebel 2010 - Kite only</h2></div>\r\n<div class=\"product_text3\">From fantastic, glassy speed tracks to every kind of waves, Rebel 2010 is the ultimate all-terrain free ride kite of your dreams!</div>\r\n<div class=\"product_text3\">&nbsp;</div>\r\n<div class=\"product_text3\">The very smooth, agile control behavior supports much response, even with a depowered shield. This makes Rebel to an ideal kite in surfing and a great toy in probably all conditions.<br />\r\n<br />The loaded fifth leach design gives Rebel 2010 100% security and a short and aggressive force path that is 30% shorter then at kites with bridles.</div>\r\n<div class=\"product_text3\"><br />\r\nThis means that a really huge wind range can be covered with just one kite - ideal for days with unpredictable flurry winds. Moreover, the short power stroke supports the luxury of an ON/OFF mode that is especially important down the line in the waves. The new floating strut - a middle tube that is not connected over the entire length with the drapery - supports a free move of the canopy above the tube.&nbsp;This allows a fuller flow and a rock solid position in the zenith in powered up state, as well as a more direct depower. The new \"V\" binding of the backlines directly transmits the strain of the backlines for a very solid feel at the bar. In combination with the new bungee system all unwanted snarls during the relaunch are avoided. The well-known, unique sensitivity and smoothness of Rebel\'s controls were enhanced by and additional segment in the leading edge again. The ultra-clean, flatter-free canopy near the tips will send continuous response about every move of the kite over the bar. So stop dreaming, grab your Rebel and up on the water!</div>\r\n<div class=\"product_text3\">&nbsp;</div>\r\n<div class=\"product_text3\"><strong>Top points:</strong></div>\r\n<div class=\"product_text3\">\r\n<ul>\r\n<li> Free ride / wave orientation<br />\r\n</li>\r\n<li>loaded 5th leash concept<br />\r\n</li>\r\n<li>short and straight power stroke / power path<br />\r\n</li>\r\n<li>floating center strut<br />\r\n</li>\r\n<li>V back leash system with integrated relaunch bungees<br />\r\n</li>\r\n<li>straight and quickly followed steering commands, &nbsp;Lenkbefehle, even completely depowered<br />\r\n</li>\r\n<li>low drag design<br />\r\n</li></ul>\r\n<div><strong>Delivery:</strong></div>\r\n<ul>\r\n<li>Kite </li>\r\n<li>Bag </li>\r\n<li>Repair Kit </li></ul>></p></div>','','','2016-07-19 14:11:15'),('b5685a5230f5050475f214b4bb0e239b','<div class=\"product_title_big\">\r\n<h2>Liquid Force Index Boot 2010</h2></div>\r\n<div class=\"product_text3\">\r\n<div><strong>&nbsp;</strong></div>\r\n<div><strong>Eigenschaften: </strong><br />\r\n</div>\r\n<div>\r\n<ul>\r\n<li> Neues IP Chassis fr 2010!<br />\r\nZahlreiche Einstellmglichkeiten sorgen fr einen sicheren Stand.<br />\r\n</li>\r\n<li>Pillow Top Liner<br />\r\nExtra weiche Einlagen bieten hohen Tragekomfort auch bei langen Marathon-Sessions. <br />\r\n</li>\r\n<li>Dual Comfort Gussets on Toe Piece<br />\r\nSorgt fr eine perfekte Passform und minimiert unangenehme Druckstellen im Fubereich.<br />\r\n</li>\r\n<li>EZ Glide Lacing<br />\r\nSpeziell entwickelte Schnrsenkel und Schlaufen sorgen fr perfekten Halt und einfaches Handling. .</li>\r\n<li>Multi-Fit Design (5-8, 8-12, 12-15)</li></ul></div></div>','<div class=\"product_title_big\">\r\n<h2>Liquid Force Index Boot 2010</h2></div>\r\n<div class=\"product_text3\">\r\n<div><strong>&nbsp;</strong></div>\r\n<div><strong>Features: </strong><br />\r\n</div>\r\n<div>\r\n<ul>\r\n<li> IP Chassis&#8230; New for 2010!<br />\r\n  Reliable, hassle-free adjustment&#8230; Angle Locks hold strong and allow for easier stance adjustment than ever before.</li>\r\n<li>Pillow Top Liner<br />\r\n  Extra soft padding where you need it most. Eliminates shin and calf discomfort from those marathon sessions.</li>\r\n<li>Dual Comfort Gussets on Toe Piece<br />\r\n  Allows toe piece to lift while foot easily slides into boot. No pinch points and a better fit.</li>\r\n<li>EZ Glide Lacing<br />\r\n  Specially designed laces and lace loops work together to lock you in and let you out of the boot quickly and easily.</li>\r\n<li>Integrated Heel Piece<br />\r\n  Heel piece is integrated into overlay for easier entry and more comfortable fit when in boot.</li>\r\n<li>Multi-Fit Design (5-8, 8-12, 12-15)<br />\r\n  Specially designed tongue allows for proper fit on the widest range of\r\n foot sizes possible. Share the boots with a family member or your\r\nfriends.</li></ul>></p></div></div>','','','2016-07-19 14:11:15'),('b56c560872da93602ff88c7267eb4774','<div class=\"product_title_big\">\r\n<h2>Naish Park 2011 - nur Kite</h2></div>\r\n<div class=\"product_text3\">Designziel:&nbsp; Rider, die eine unkomplizierte, schnrkellose Performance suchen.<br />\r\n    Als ein &#8222;Rundum-sorglos-Paket&#8220; ist der Park ist ein auf Performance fokussierter Kite.<br />\r\n<br />\r\n    Das Design des Park mit drei Struts ist stabil und reaktionsschnell.\r\n Diese Konfiguration gibt dem Park in Kombination mit seinem\r\nausgeprgten Profil und seiner vollen Outline den bestndigen Zug eines\r\n&#8222;C&#8220;-Kites und die Power und Kontrolle eines Swept Kites.<br />\r\n<br />\r\n    Die nach hinten geschwungene Fronttube positioniert die Wing Tips\r\nhinter dem Zentrum des Kites, was die Relaunch-Fhigkeiten verbessert\r\nund die Depower maximiert.<br />\r\n<br />\r\n    Die &#8220;Einer-fr-Alles&#8221; Charakteristik des Park erffnet dem Rider\r\neinen breiten Einsatzbereich. Er ist das perfekte Werkzeug, egal ob sie\r\nsich auf Handle-Pass-Rotation konzentrieren, die Wellenlippe rippen,\r\noder einfach nur Ihre Freeride-Zeit auf dem Wasser verlngern mchten.<br />\r\n<br />\r\n    Der Park ist kompatibel&nbsp; zum LWR-System (Leichtwind-Relaunch).<br />\r\n<br />\r\n<div><strong>Artikelmerkmale:</strong></div>\r\n<ul>\r\n<li>Drei-Strut-Kite mit supergeringem Gewicht<br />\r\n    perfekt fr Leichtwindeinsatz und unglaublich spielerisches Handling</li>\r\n<li>Swept-Compact-C&#8211;C-Outline<br />\r\n    fr hohe schnelle Turns und Freestylepower kombiniert<br />\r\n    geschwungene Wingtips fr bessere Depower und vereinfachten Wasserstart</li>\r\n<li>Solid-Frame<br />\r\n    mehr Stabilitt durch Befestigung jedes Struts mit Schwerlast-Dacron auf der Canopy</li>\r\n<li>Optionaler Leichtwind-Relaunch(LWR)<br />\r\n    mit 5.LWR-Leine fr Wasserstart bei nahezu null Wind</li>\r\n<li>Octopus One-PumpSystem<br />\r\n    mit neuem One-Way-Inflation-Ventil fr noch einfacheres Aufpumpen</li>\r\n<li>Direkter Zugang zu den Struts ber Reiverschluss fr unkomplizierten Bladderwechsel</li>\r\n<li>4-Lines (20m)<br />\r\n</li></ul><strong></strong><strong>Lieferumfang:</strong>\r\n<ul>\r\n<li> Kite</li>\r\n<li>Tasche</li>\r\n<li>Reparatur-Kit</li>\r\n<li>Internationale Garantie</li>\r\n<li>Anleitung</li></ul></div>','<div class=\"product_title_big\">\r\n<h2>Naish Park 2011 - Kite only</h2></div>\r\n<div class=\"product_text3\">Design aim:&nbsp; Riders looking for an easy, no-frills performance.<br />\r\nAs an \"all-inclusive package\", the Park is a focussed on performance kite.<br />\r\n<br />The design of the Part with its three struts is stable and responsive. This configuration, in combination with its distinctive profile and the full outline, gives the Park the constant tension of a c-kite and the power and control of a swept kite.</div>\r\n<div class=\"product_text3\">&nbsp;</div>\r\n<div class=\"product_text3\">The curved front tube positions the wing tips behind the center of the kite which improves the relaunch and maximizes the depower.<br />\r\n<br />The \"one-for-all\" characteristics of the Park opens the rider a wide range of application. It is the perfect tool no matter if you concentrate on the handle pass rotation, rip the wave lips or simple want to extend the free ride time at the water.</div>\r\n<div class=\"product_text3\"><br />\r\nThe Park is compatible to the LWR system (light wind relaunch).</div>\r\n<div class=\"product_text3\"><br />\r\n<div><strong>Product attributes:</strong></div>\r\n<ul>\r\n<li>Three strut kite, super light weight<br />\r\nperfect for light wind use and unbelievable playful handling</li>\r\n<li>swept compact c-c-outline<br />\r\ncombined for high and quick turns and free style power<br />\r\n    curved wing tips for better depower and simplified water launch</li>\r\n<li>solid frame<br />\r\nmore stability by securing each strut with heavy duty Dacron on the canopy</li>\r\n<li>optional light wind relaunch (LWR)<br />\r\nwith fifth LWR leash for water launch at nearly no wind</li>\r\n<li>Octopus one pump system<br />\r\nwith new one way inflation valve for easier inflation</li>\r\n<li>direct access to the struts via the zipper for easy bladder exchange</li>\r\n<li>4 leaches (20m)<br />\r\n</li></ul><strong></strong><strong>Delivery:</strong>\r\n<ul>\r\n<li> Kite</li>\r\n<li>Bag</li>\r\n<li>Repair kit</li>\r\n<li>International warranty</li>\r\n<li>Instruction manual</li></ul>></p></div>','','','2016-07-19 14:11:15'),('d861ad687c60820255dbf8f88516f24d','<h2><strong>Cabrinha Inflation Pumpe 2011</strong></h2>\r\n<p>Zuverlssige Pumpe von Cabrinha mit Alu-Schaft. Ermglicht bequemes und exaktes Aufpumpen des Kites. Besticht durch hochwertige Verarbeitung und neues Design. </p>\r\n<p> </p>','<div id=\"description\" class=\"tabcontent ui-tabs-panel ui-widget-content ui-corner-bottom\">\r\n<h2><strong>Cabrinha Inflation Pump 2011</strong></h2>\r\n<p>The 2011 model of the Cabrinha Inflation Pump is featured with an aluminium piston. It is very easy to handle and has a totally revamped design. &nbsp;</p>></p></div>','','','2016-07-19 14:11:15'),('d86236918e1533cccb679208628eda32','<p><span>Bewhrte Smart Loop Trimmleine fr Shift Control Systeme von Naish.<br />\r\n</span></p>\r\n<p></p>','<p><span>Replacement Naish Smart Loop with trim line for shift system bars.</span></p>></p>','','','2016-07-19 14:11:15'),('d862c91305fe0d5e86f82122ae9e367c','<p>\r\n<div class=\"product_title_big\">\r\n<h2>O\'Brien Decade Impact Base & Decade CT Boot 2010</h2></div>\r\n<div><strong>Board:</strong></div>\r\n<div><strong></strong><br />\r\nDas Wakeboard vereint die zehnjhrige Erfahrung von Daniel im\r\nWakeboarden mit der technischen Weiterentwicklung in Form und Qualitt.\r\nDas Decade basiert auf dem Natural, jedoch wurden verschiedene sehr gute\r\n Eigenschaften von anderen Shapes mit integriert, wie z.B. vom Player.<br />\r\n<br />\r\n   Die wichtigsten Features sind die abriebfeste PTEX Impact Grind Base\r\nBeschichtung zum Obstacle shredden, die neue DELTA Base, die\r\nverfeinerten &#8222;molded in&#8220; Finnen und die abgerundeten Kanten zum Schutz\r\ngegen Ste.<br />\r\n<br />\r\n      Das Wakeboard lst auf der Kante leicht aus und spricht sehr gut an. &#8222;&#8230;with more pop than ever before.&#8220;</div>\r\n<div>&nbsp;</div><span><strong>Bindung:</strong><br />\r\n<br /></span>Die Decade Pro Bindung ist nicht nur Close-Toe Boots mit hammer\r\nStyle, sondern es war das Ziel den Komfort von normalen Boots in eine\r\nWakeboard-Bindung einzubringen, dabei leichtgewichtig zu bleiben, und\r\ndamit perfekte Performance auf dem Wasser zu ermglichen.<br />\r\n<br />\r\n   Die Wakeboard-Bindung ist in der Gre gleich bleibend, gibt also im\r\nLaufe der Zeit nicht nach und sitzt somit wie ein perfekter Schuh. Ein\r\nergonomisches und stoabsorbierendes Fussbett sorgt fr weiche\r\nLandungen. <span></span></p>\r\n<p><span><br />\r\n</span></p>','<div class=\"product_title_big\">\r\n<h2>O\'Brien Decade Impact Base & Decade CT Boot 2010</h2></div>\r\n<div><strong>Board:</strong></div>\r\n<div><strong></strong><br />\r\nThe wake board combines the ten-year experience of Daniel in wake boarding with the technical development of form and quality. Decade is based on Natural, however, several very good attributes of other shapes were integrated, like for example from Player.</div>\r\n<div>&nbsp;</div>\r\n<div>The main features are the abrasion-resistant PTEX Impact Grind Base coating for shredding the Obstacle, the DELTA base, the refined \"molded in\" fins and the rounded edges to protect against impact.<br />\r\n<br /></div>\r\n<div>The wake board easy releases on the edge and responses very well. \"... with more pop than ever before.\"</div>\r\n<div>&nbsp;</div><span><strong>Binding:</strong><br />\r\n<br /></span>\r\n<div>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\" />The Decade Pro binding is not only a close-toe boot in a very fancy style. The aim was, to integrate the comfort of regular boots into a wake board binding, to stay lightweight and to reach a perfect performance at the water.<br />\r\n<br /><span>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\" />The wake board binding keeps it\'s size, doesn\'t ease off in a time and fits like a perfect shoe. The ergonomic and absorbing insole provides soft landings.</span></div>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>></p>','','','2016-07-19 14:11:15'),('d8631f92ababb452139f222afb81cd36','<p>\r\n<div class=\"product_title_big\">\r\n<h2>Naish Momentum 2011 - Glass Finnen</h2></div>\r\n<div>Das Momentum bietet dank seiner\r\nweichen Kanten ausgeglichene Power,  einfache Kontrolle, konstantes\r\nGleiten und unbegrenztes  Performance-Potenzial. Nach seiner Einfhrung\r\nim letzten Jahr ist das  Momentum das meistgefragte Board in der Naish\r\nRange geworden.<br />\r\n<br />\r\n   Obwohl das Momentum ursprnglich fr Wakestyle-Rider gebaut wurde,\r\nist  es mittlerweile eines der fhrenden Freeride-Boards. Mit groer\r\nOberflche, ausgeprgtem Rocker und groartigem Flex bietet dieses Board\r\n  dem Freerider mheloses Gleiten, weiche Landungen und einen sanften\r\nRitt auch bei starkem Wellengang. <br />\r\n<br />\r\n   Mit seiner radikalen und geschmeidigen Performance, dem massiven\r\nFreestyle Pop und der berragenden Kontrolle, die selbst die\r\nschwierigste Moves zu einem Kinderspiel macht, ist das Momentum Deine\r\nChance, die nchste Knnensstufe zu erreichen. Ob Du Deine Boots fr den\r\n  Park schrst oder einfach nach einem Freeride-Board mit\r\nTop-Performance  suchst, das Momentum ist wie fr Dich gemacht.<br />\r\n<br />\r\n   Neu fr 2011 ist das Momentum Park. Das 138 Park wurde eingefhrt, um\r\n  den Ansprchen von Boots-Style Ridern und all jenen, die ein wenig\r\nmehr  Oberflche mchten, gerecht zu werden. Das 138 Park verfgt ber\r\nmehr  Verstrkungen fr verbesserte Haltbarkeit beim Fahren im Wakepark\r\nund  zustzliche Steifigkeit fr explosiven Load und Pop. Das Momentum\r\nPark  hat alles, was es braucht, um Ihr Knnen auf das nchste Level zu\r\n schrauben. <br />\r\n<br /><strong>Eigenschaften:</strong><br />\r\n<ul>\r\n<li>Momentum Park 138:<br />\r\n        Mehr Verstrkungen fr Fahren im Wake-Park und zustzliche\r\nSteifigkeit fr explosiven Load und Pop. Ideales Leichtwindboard fr\r\nRider ber 100kg.</li>\r\n<li>Fusion Footstrap- Bindungssystem:<br />\r\n        vorgeformtes Fubett mit rutschsicherer Grip- Textur fr\r\nunglaublichen Halt und verbesserte Polsterung mit super komfortablen\r\nSchock Absorbern und Carbon Footpad Platte.</li>\r\n<li>Carbon-Grab-Handle fr spielerisches Handling bei Board-Off-Manvern.</li>\r\n<li>Kite Finnen Gre 5&#8221; aus G10 Material<br />\r\n</li></ul></div>\r\n<div><strong>Lieferumfang:</strong><br />\r\n<ul>\r\n<li>Kiteboard</li>\r\n<li>Fusion Pads + Straps</li>\r\n<li>Glass Finnen</li>\r\n<li>Carbon Handle <br />\r\n</li></ul></div><strong>Gren:</strong><br />\r\n<br />\r\n        130x40 / 132x41 / 134x42 / 138x43</p>\r\n<p> </p>','<div class=\"product_title_big\">\r\n<h2>Naish Momentum 2011 - Glass Fins</h2></div>\r\n<div>Momentum, thanks to its soft edges supports balanced power, simple control, consistent sliding and unlimited performance potential. After its introduction in the last year, Momentum became the most popular board in the Naish range.</div>\r\n<div><br />\r\nAlthough the momentum originally was build for wake style riders, it became one of the leading free ride boards in the mean time. With it\'s big surface, the pronounced rocker and excellent flex this board offers effortless gliding, soft landings and a smooth ride even in heavy seas.</div>\r\n<div><br />\r\nWith its radical and smooth performance, the massive free style pop and the outstanding control (that even makes the most difficult moves to a child\'s play), Momentum is your chance to reach the next skill level. Looking for a free ride board with top performance? Momentum is made for you!</div>\r\n<div><br />\r\nMomentum Park is new in 2011. The 138 Park was introduced to meet the needs of boots style riders and those to want to have a bit more of surface. The 138 Park has more reinforcements for increased durability when riding in the wake park and additional stiffness for explosive load and pop. Momentum Park has everything it needs to screw your skills to the next level.</div>\r\n<div><br />\r\n<strong>Properties:</strong><br />\r\n<ul>\r\n<li>Momentum Park 138:<br />\r\nMore reinforcements for rides in the wake park and additional stiffness for exploding load and pop. The ideal light weight board for riders over 100 kg.</li>\r\n<li>Fusion foot-strap binding system:<br />\r\npreformed footbed with non-slip grip texture for incredible grip and increased padding and super comfortable shock absorbers and carbon footpad plate.</li>\r\n<li>carbon grab handle for easy handling at board-off maneuvers.</li>\r\n<li>kite fins size 5\'\' of G10 material</li></ul></div>\r\n<div><strong>Delivery:</strong><br />\r\n<ul>\r\n<li>Kite board</li>\r\n<li>Fusion pads + straps</li>\r\n<li>Glass fins</li>\r\n<li>Carbon handle <br />\r\n</li></ul></div><strong>Sizes:</strong><br />\r\n<br />\r\n        130 x 40 / 132 x 41 / 134 x 42 / 138 x 43\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>></p>','','','2016-07-19 14:11:15'),('d866060a82d29bc94db20bdfd0e73713','<p>\r\n<div class=\"product_title_big\">\r\n<h2>O\'Brien Vice & Vice CT Boot 2010</h2></div>\r\n<div><span><strong>Board:</strong></span></div>\r\n<div>&nbsp;</div>\r\n<div>Das Vice von Josh Sanders wird gerne als der Wellenbrecher der\r\nO\'Brien Serie bezeichnet, denn es hat die Breite und den progressiven\r\nRocker fr riesige Hhen und eine lange center spine fr butterweiche\r\nLandungen.</div>\r\n<div>&nbsp;</div>\r\n<div>Die Crook Finnen, welche dem Board keinen Speed nehmen, geben ihm\r\nStabilitt und absolute Kantenkontrolle, egal wie aggressiv Sie es\r\nkanten.</div>\r\n<div>&nbsp;</div>\r\n<div>Die DELTA Base macht es noch schneller, so knnen Sie lngere Runs fahren und hher fliegen.</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Bindung:</strong></div>\r\n<div><strong>&nbsp;</strong></div>\r\nDie Vice Pro Bindung sind nicht nur Close-Toe Boots mit hammer\r\nStyle, sondern es war das Ziel den Komfort von normalen Boots in eine\r\nWakeboard-Bindung einzubringen, dabei leichtgewichtig zu bleiben, und\r\ndamit perfekte Performance auf dem Wasser zu ermglichen.<br />\r\n<br />\r\n    Die Wakeboard-Bindung ist in der Gre gleich bleibend, gibt also im\r\n Laufe der Zeit nicht nach und sitzt somit wie ein perfekter Schuh. Ein\r\nergonomisches und stoabsorbierendes Fubett sorgt fr weiche\r\nLandungen.&nbsp;</p>\r\n<p> </p>','<div class=\"product_title_big\">\r\n<h2>O\'Brien Vice & Vice CT Boot 2010</h2></div>\r\n<div><span><strong>Board:</strong></span></div>\r\n<div>&nbsp;</div>\r\n<div>Vice by Josh Sanders is called the breakwater of the O\'Brien series because it has the width and the progressive rocker for huge heights and a long center spine for soft landings.</div>\r\n<div>&nbsp;</div>\r\n<div>The Crook fins do not limit the speed of the board and give him stability and absolute edge control no matter how aggressive you tilt it.</div>\r\n<div>&nbsp;</div>\r\n<div>The DELTA base makes it even faster. Thus, you can ride longer runs and fly even higher.</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Binding:</strong></div>\r\n<div><strong>&nbsp;</strong></div>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\" />The Vice Pro binding is not only a close-toe boot in a very fancy style. The aim was, to integrate the comfort of regular boots into a wake board binding, to stay lightweight and to reach a perfect performance at the water.<br />\r\n<br /><span>The wake board binding keeps it\'s size, doesn\'t ease off in a time and fits like a perfect shoe. The ergonomic and absorbing insole provides soft landings.</span>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>></p>','','','2016-07-19 14:11:15'),('d86e244c8114c8214fbf83da8d6336b3','<div class=\"product_title_big\">\r\n<h2>Liquid Force Shane 2010</h2></div>\r\n<div class=\"product_text3\">\r\n<div>Shane Bonifay ist eine Ikone im\r\nWakeboardsport. Sein Pro-Model begeistert so wie sein Riding. Es ist\r\nschnell und smooth zugleich und bringt jede Menge Spa auf dem Wasser.</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Eigenschaften:</strong></div>\r\n<ul>\r\n<li>Double to Triple Concave Hull</li>\r\n<li>D-I-S-C hull through center, deepens underfoot, into triple out the tail<br />\r\n         DISC for softening impact and maintaining speed<br />\r\n         Deep double for precise sweet spot lift under your feet<br />\r\n         Triple concave with BIG center single for ollie power and pop</li>\r\n<li>Winged scalloped tail outline - full shape with release at rail wings<br />\r\n         Allows rider to shorten the arc of his turn off the wing for slaying</li>\r\n<li>Molded in Warped long base side fins<br />\r\n         Smooth water flow, superior hold, minimum drag</li>\r\n<li>Shallow canted inside fins placed at edge of center tip concave<br />\r\n         Acts as extension of concave to maximize the thrust through center</li>\r\n<li>Low volume rails with thinned out tip section<br />\r\n         Faster on edge with more hold<br />\r\n         Low swing weight and tip flex</li>\r\n<li>Lifted Variable edge rails<br />\r\n         Slight bevel, rounded to sharp through length of rail</li>\r\n<li>Aggressive, 3-stage Rocker<br />\r\n         Gives the rider the highest trajectory arc off the wake for a straight-up pop.<br />\r\n         Coupled with the deep single concave between the center set of fins, the new Shane has unmatched ollie power</li>\r\n<li>Shallow Scalloped Tail<br />\r\n         Full tip area working with the large concave exiting through the center</li></ul></div>','<div class=\"product_title_big\">\r\n<h2>Liquid Force Shane 2010</h2></div>\r\n<div class=\"product_text3\">\r\n<div>Shane Bonifay is an icon in wake board sports. His professional model inspires the same way his riding does. It is fast and smooth the same time and brings a lot of fun at the water.</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Properties:</strong></div>\r\n<ul>\r\n<li>Double to triple concave hull</li>\r\n<li>D-I-S-C hull through center, deepens underfoot, into triple out the tail<br />\r\n         DISC for softening impact and maintaining speed<br />\r\n         Deep double for precise sweet spot lift under your feet<br />\r\n         Triple concave with BIG center single for ollie power and pop</li>\r\n<li>Winged scalloped tail outline - full shape with release at rail wings<br />\r\n         Allows rider to shorten the arc of his turn off the wing for slaying</li>\r\n<li>Molded in Warped long base side fins<br />\r\n         Smooth water flow, superior hold, minimum drag</li>\r\n<li>Shallow canted inside fins placed at edge of center tip concave<br />\r\n         Acts as extension of concave to maximize the thrust through center</li>\r\n<li>Low volume rails with thinned out tip section<br />\r\n         Faster on edge with more hold<br />\r\n         Low swing weight and tip flex</li>\r\n<li>Lifted Variable edge rails<br />\r\n         Slight bevel, rounded to sharp through length of rail</li>\r\n<li>Aggressive, 3-stage Rocker<br />\r\n         Gives the rider the highest trajectory arc off the wake for a straight-up pop.<br />\r\n         Coupled with the deep single concave between the center set of fins, the new Shane has unmatched ollie power</li>\r\n<li>Shallow Scalloped Tail<br />\r\n         Full tip area working with the large concave exiting through the center</li></ul>></p></div>','','','2016-07-19 14:11:15'),('d86f775338da3228bec9e968f02e7551','<div class=\"product_title_big\">\r\n<h2>Vector Kite Leinen Quad Pro 270kg</h2></div>\r\n<div class=\"product_text3\">VEKTOR Leinen sind besonders zur\r\nPrzisionssteuerung in allen Kite Disziplinen bestimmt. Kiteleinen sind\r\ndie einzige Verbindung zwischen Ihnen und Ihrem Kite und knnen darber\r\nentscheiden, ob Ihr Kite gut oder ausgezeichnet ist. VEKTOR Leinen sind\r\ndnn, glatt, und haben minimalen Reck.<br />\r\n<br />\r\n           VEKTOR Leinen werden mit Dyneema hergestellt. Diese\r\nHochleistungs-Polythylenfaser ist berraschender Weise 15 mal strker\r\nals Stahl.<br />\r\n<br />\r\n           VEKTOR Leinen sind besonders glatt. Dadurch minimieren sie das Risiko eines Leinenbruchs. <br />\r\n<br />\r\n           VEKTOR Leinen sind nicht nur extrem stark, sie werden auch\r\nsehr gut gegen Wetter und damit in Verbindung stehende Einflsse\r\ngeschtzt. Der Spezialbeschichtung schtzt gegen UV-Licht,\r\nTemperaturschwankungen, Sand, Salz und Wasser. Auerdem bieten die\r\nLeinen ausgezeichneten Widerstand gegen Abnutzung und Knicke.<br />\r\n<br />\r\n           VEKTOR Leinen sind vor-gereckt. Der minimale Reck in den\r\nVEKTOR Leinen ermglicht eine exakte Rckmeldung des Kites und fhrt zu\r\neiner verbesserten Steuerung. Dank der hohen Bruchlast der VECTOR Leinen\r\n knnen diese dnner sein. Mit dem minimierten Windwiderstand knnen Sie\r\n Ihren Kite auch bei schwcheren Winden fliegen.<br />\r\n<br />\r\n           VEKTOR Leinen knnen Sie direkt aus der Verpackung verwendet\r\nwerden. Die Linien sind von gleicher Lnge und vorgereckt.<br />\r\n<br />\r\n           Die VEKTOR Color Pro, Quad Pro und Precision Reihen werden\r\nmit genhte Loops hergestellt. Das Nhen garantiert die strkst -\r\nmgliche Verbindung. Die glatten Verbindungen verringern die\r\nWahrscheinlichkeit der Leine Verwicklungen.<br />\r\n<br />\r\n           Farbcode. Nachdem der Herstellungsproze werden die Leinen\r\ngefrbt und PU beschichtet. Auer dem maximalen Schutzes, Lat es Sie\r\nauf einen Blick erkennen, welche Leine wohin gehrt.<br />\r\n<br />\r\n           VEKTOR Leinen gibt es in unterschiedlichen Ausfhrungen:<br />\r\n           VEKTOR Pro Color<br />\r\n           VEKTOR Quad Pro</div>\r\n<p class=\"product_text3\"><strong>&nbsp;</strong></p>\r\n<p class=\"product_text3\"> </p>','<div class=\"product_title_big\">\r\n<h2>Kite lines Vector Quad Pro 270 kg</h2></div>\r\n<div class=\"product_text3\">VEKTOR lines are designed especially for precision control in all kite disciplines. Kite lines are the only connection between you and your kite and can decide if your kite is good or excellent. VEKTOR lines are slim, smooth and have a minimal stretch.</div>\r\n<div class=\"product_text3\"><br />\r\n           VEKTOR lines are produced with Dyneema. Surprisingly, this high-performance polyethylene fiber is 15 times stronger then steel.<br />\r\n<br />\r\n           VEKTOR leashes are especially smooth. Leinen sind besonders glatt. This minimizes the risk of a leash fracture.<br />\r\n<br />\r\n           VEKTOR lines are not only extremely strong. They are protected very good against weather and related factors. The special coating protects against UV light, temperature, sand, salt and water. Furthermore, the lines resist excellently against abrasion and kinks.</div>\r\n<div class=\"product_text3\">&nbsp;</div>\r\n<div class=\"product_text3\">VEKTOR lines are pre-stretched. The minimal stretch of the VEKTOR lines supports an exact response of the kites and leads to improved control. Thanks to the high breaking load, VEKTOR lines can be thinner. With the minimized wind resistance, you can fly your kite at weaker winds as well.</div>\r\n<div class=\"product_text3\"><br />\r\n           VEKTOR lines can be used out of the box. The lines are of the same length and pre-stretched.<br />\r\n<br />VEKTOR Color Pro, Quad Pro and Precision series are made with stitched loops. Stitching guarantees the strongest possible connection. The smooth connections reduce the chance of line tangles.<br />\r\n<br />Color code. After manufacturing, the lines are colored and PU coated. Besides the maximum protection you will see on a first glance which line belongs where.<br />\r\n<br />There are several editions of VEKTOR lines:<br />\r\n           VEKTOR Pro Color<br />\r\n           VEKTOR Quad Pro</div>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>></p>','','','2016-07-19 14:11:15'),('dc5480c47d8cd5a9eab9da5db9159cc6','<div class=\"product_title_big\">\r\n<h2>RRD Passion 2009</h2></div>\r\n<div style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\">Die\r\n bewhrte Linie der Hybrid Delta Kites. Eine unglaubliche\r\nLeichtwindperformance kombiniert mit einer extrem guten Depowerfhigkeit\r\n bei einem optimalen Turning Speed machen den Kite zu einem echten\r\nAllrounder. Dabei ist der Passion sehr stabil in der Luft, kraftvoll und\r\n sehr leicht zu relaunchen. Egal ob Einsteiger oder Knner, der Kite\r\ndrfte 95% aller Kiter glcklich machen. <br />\r\n<br /><strong>Merkmale: </strong><br />\r\n<ul>\r\n<li>Stabilitt</li>\r\n<li>Enorme Power</li>\r\n<li>Leichtes und progressives De-Powern</li>\r\n<li>Mittlere bis leichte Bar Haltekrfte</li>\r\n<li>Sofortiger Re-launch<br />\r\n</li></ul><strong>Technologie:</strong><br />\r\n<ul>\r\n<li>Neues SPS System mit neu entwickeltem Ventil</li>\r\n<li>LE Parallel Nhte fr maximale Strke, flach genht</li>\r\n<li>Hei geklebtes Double Tape Liek</li>\r\n<li>PVC abgerundete Verstrkung der Enden der Querstruts</li>\r\n<li>Metallic PU verstrkte Quertube-Enden</li>\r\n<li>DP 175 LL Dacron</li>\r\n<li>Tejin&nbsp; T9600 Canopy</li>\r\n<li>Neu geformte Quertube Protektoren</li>\r\n<li>Neue PVC Ventil Protektoren<br />\r\n</li></ul><br />\r\n<font color=\"#ff0000\"><strong>Seb Garat:</strong></font></div>\r\n<div style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\"><br />\r\n               \"Den Passion probierte ich das erste Mal whrend des\r\n2009er RRD Photo Shootings in gypten aus. Es ist ein Delta Shape Kite.\r\nIch probierte zuerst den 13er aus, den grten Passion Kite, da wir am\r\nersten Tag recht wenig Wind hatten. Trotzdem, der Kite vermittelt eine\r\nunglaubliche Power. Der 13er besitzt soviel Power wie ein normaler 15er\r\noder 16er Kite. Ich versuchte den ersten Sprung und es war unglaublich\r\nleicht in die Luft zu kommen. Dank dieser Power gelangen mir sogar\r\neinige Board-Off&#8217;s, sogar unter diesen Leichtwindbedingungen - es waren\r\nwohl ca. 12 Knoten -.<br />\r\n               Der Passion verfgt auch ber eine enorme Depower: wenn\r\ndu die Bar bis zum Limit wegschiebst, hast du berhaupt keine Power mehr\r\n und was das Beste ist: diese Depower ist wirklich progressiv!!<br />\r\n<br />\r\n               Aber den grten Vorteil dieses Kites entdeckte ich als\r\nmein Kite ins Wasser fiel whrend einigen unhooked Tricks: &#8222;Der Relaunch\r\n auf dem Wasser ist SO EINFACH!&#8220; Man muss fast gar nichts tun, um diesen\r\n Passion zu relaunchen. Nur an der Back Line ziehen und der Kite geht\r\nsofort zur Windfenster Seite und relaunched auf der Stelle. Vielleicht\r\nist der Kite nicht der allerbeste fr einige &#8222;Handle Pass&#8220; und New\r\nSchool Tricks, aber mit den richtigen Einstellungen ist sogar das\r\nmglich.<br />\r\n<br />\r\n               Mit Starkwind probierte ich auch den 9er Passion und auch\r\n dieser ist wirklich ein hervorragender Kite. Mit diesem Kite gelangen\r\nmir einige vllig unglaubliche Sprnge! Und selbstverstndlich bei\r\nvlliger Kontrolle der Power.<br />\r\n<br />\r\n               Der Passion ist ein reiner Freeride Kite. Trotz seines\r\nmittleren &#8222;Turning Speeds&#8220; sind durchgezogene Kiteloops jederzeit\r\nmglich!<br />\r\n<br />\r\n               Abschlieen kann ich sagen, dass der Passion ein Kite\r\nist, der fr die allermeisten Leute hervorragend geeignet ist. Es ist\r\nein sehr guter Kite zum Lernen, vor allem mit den kleinen Gren. Und er\r\n ist ebenfalls perfekt fr jeden, der mit seinem Kite wirklich alles\r\nmachen will! Es ist DER Freeride Kite.\"</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Lieferumfang:</strong></div>\r\n<ul>\r\n<li>Kite Passion</li>\r\n<li>Global Bar mit Leinen<br />\r\n</li>\r\n<li>Pumpe</li>\r\n<li>Kitebag</li></ul>','<div class=\"product_title_big\">\r\n<h2>RRD Passion 2009</h2></div>\r\n<div style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\">The proven series of the hybrid delta kites. An incredible light wind performance combined with an extremely good depower ability at an optimal turning speed make the kite to a real all-rounder. Passion is very stable in the air, powerful and easy to relaunch. No matter if beginner or expert the kite makes 95% of all kiters happy.</div>\r\n<div style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\"><br />\r\n<strong>Properties: </strong><br />\r\n<ul>\r\n<li>Stability</li>\r\n<li>Enormous power</li>\r\n<li>Easy and progressive depower</li>\r\n<li>Medium to light bar holding power</li>\r\n<li>Immediate relaunch<br />\r\n</li></ul><strong>Technology:</strong><br />\r\n<ul>\r\n<li>New SPS system with a newly developed valve</li>\r\n<li>LE parallel stitches for maximum power, plain stitched</li>\r\n<li>Hot glued Double Tape Liek</li>\r\n<li>PVC rounded reinforcement of the ends of the cross-struts</li>\r\n<li>Metallic PU reinforced ends of the cross-tubes</li>\r\n<li>DP 175 LL Dacron</li>\r\n<li>Tejin&nbsp; T9600 Canopy</li>\r\n<li>New formed cross-tube protections</li>\r\n<li>New plastic valve protections<br />\r\n</li></ul><br />\r\n<font color=\"#ff0000\"><strong>Seb Garat:</strong></font></div>\r\n<div style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\">&nbsp;</div>\r\n<div style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\"><em>\"I tried Passion the first time during the RRD photo shooting in Egypt in 2009. It is a delta shape kite. First I tried the size 13, the biggest Passion kite because the had a very little wind on the first day. Nevertheless, the kite developed an incredible power. The size 13 has as much power as a regular size 15 or 16 kite. I tried the first jump and it was incredibly easy to get into the air. Thanks to this power I even managed some board off\'s, even under this light wind circumstances (it was probably 12 knots). Passion also has a huge depower: if you push the bar up to the limit you will have no power at all and the best of all is: this depower is really progressiv!!</em></div>\r\n<div style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\"><em><br />\r\n</em></div>\r\n<div style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\"><em>But the biggest advantage of this kite I discovered when my kite fall into the water during some unhooked tricks: The water relaunch is that simple! You nearly don\'t have to do anything to relaunch this Passion. Simply pull the back leash and the kite relaunches immediately at the wind site. Perhaps, this kite is not the very best for some handle pass or new school tricks but with the right options even this is possible.</em></div>\r\n<div style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\"><em><br />\r\n</em></div>\r\n<div style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\"><em>With heavy wind I tried the Passion size 9 as well and this one is also a really outstanding kite. With this kite, I managed some absolutely incredible jumps! And of course in complete control of the power.</em></div>\r\n<div style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\"><em><br />\r\n</em></div>\r\n<div style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\"><em>Passion is a pure free ride kite. Despite its medium \'Turning Speed\' solid kite loops are possible at any time.</em></div>\r\n<div style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\"><em><br />\r\n</em></div>\r\n<div style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\"><em>Finally, I can say that Passion is an ideal kite for most of the people. It is a very good kite for learning, especially with small sizes. And it is perfect for everybody who really wants to do everything with his kite. It is THE free ride kite!\"</em></div>\r\n<div style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\">&nbsp;</div>\r\n<div><strong>Delivery:</strong></div>\r\n<ul>\r\n<li>Kite Passion</li>\r\n<li>Global bar with leashes<br />\r\n</li>\r\n<li>Pump</li>\r\n<li>Kite bag</li></ul>></p>','','','2016-07-19 14:11:15'),('dc55b2b2e633527f9a8b2408a032f28f','<div id=\"description\" class=\"tabcontent ui-tabs-panel ui-widget-content ui-corner-bottom\"><font face=\"Verdana\" size=\"2\"><strong class=\"h3\" id=\"test_productFullTitle\">Kuyichi Grtel Juno</strong></font><font size=\"2\"></font>\r\n<div><font face=\"Verdana\" size=\"2\">&nbsp;</font></div>\r\n<div><font face=\"Verdana\" size=\"2\">Modischer Grtel von Kuychi fr Sie und Ihn.</font></div>\r\n<ul>\r\n<li><font face=\"Verdana\" size=\"2\">Grtel mit eingesticktem Kuyichi-Logo</font></li>\r\n<li><font face=\"Verdana\" size=\"2\">Robuste Edelstahlschnalle </font></li></ul></div>','<div id=\"description\" class=\"tabcontent ui-tabs-panel ui-widget-content ui-corner-bottom\">\r\n<div id=\"description\" class=\"tabcontent ui-tabs-panel ui-widget-content ui-corner-bottom\"><strong class=\"h3\" id=\"test_productFullTitle\">Kuyichi Belt Juno</strong>\r\n<div>&nbsp;</div>\r\n<div>Trendy belt for her and for him.</div>\r\n<ul>\r\n<li>stitched Kuyichi-Logo</li>\r\n<li>high quality steel belt buckle</li></ul></div></div>','','','2016-07-19 14:11:15'),('dc57391739360d306c8dfcb3a4295e19','<div class=\"product_title_big\">\r\n<h2>RRD Passion 2010 </h2></div>\r\n<div class=\"product_text3\">\r\n<div>Dieser Kite berrascht total:\r\nStabil, kraftvoll und sehr einfach zu relaunchen sowie zu depowern!\r\nDieser Kite gibt jedem das Gefhl, dass er schon immer kiten konnte. Der\r\n neue Passion wurde komplett berarbeitet so dass seine Kraft und\r\nStabilitt voll zur Geltung kommen.<br />\r\n<br /><strong>Eigenschaften:</strong><br />\r\n</div>\r\n<div>\r\n<ul>\r\n<li>Stabilitt</li>\r\n<li>Kraftvoll</li>\r\n<li>Leichte progressive Depower</li>\r\n<li>Mittlere/leichte Bar Druck</li>\r\n<li>SOFORTIGER Relaunch<br />\r\n</li></ul>\r\n<div><strong>Technologie:</strong></div>\r\n<ul>\r\n<li>Neues SPS System mit einem neu entworfenen Ventil</li>\r\n<li>Leading Edge mit parallelen Nhten fr maximale Haltbarkeit und geringere Dehnung</li>\r\n<li>hei geklebtes Double Tape Liek</li>\r\n<li>PVC abgerundete Verstrkung an den Enden der Querstuts</li>\r\n<li>Metallic-PU verstrkte Quertube-Enden</li>\r\n<li>DP 175 LL Dacron</li>\r\n<li>Tejin T9600 Canopy</li>\r\n<li>Neu geformte Quertube-Protektoren</li>\r\n<li>Neue PVC-Ventilprotektoren<br />\r\n</li></ul><strong>Gren:</strong><br />\r\n<blockquote>   13.0 | 11.0 | 9.0 | 7.0 | 5.0 | 3.0<br />\r\n</blockquote>\r\n<div><strong>Lieferumfang:<br />\r\n</strong>\r\n<ul>\r\n<li>Kite Passion</li>\r\n<li>Kitebag </li></ul></div></div></div>','<div class=\"product_title_big\">\r\n<h2>RRD Passion 2010 </h2></div>\r\n<div class=\"product_text3\">\r\n<div>This kite totally surprises: stable, powerful and very easy to relaunch and to depower! This kite gives you the feeling that you have been able to kite all the time. The new Passion has completely been reworked so its power and stability shows to advantage.</div>\r\n<div><br />\r\n<strong>Properties:</strong><br />\r\n</div>\r\n<div>\r\n<ul>\r\n<li>Stability</li>\r\n<li>Powerful</li>\r\n<li>Easy progressive depower</li>\r\n<li>Medium/easy bar pressure</li>\r\n<li>IMMEDIATE relaunch<br />\r\n</li></ul>\r\n<div><strong>Technology:</strong></div>\r\n<ul>\r\n<li>New SPS system with new developed valve</li>\r\n<li>Leading edge with parallel stitchings for maximum durability and low rotation</li>\r\n<li>Hot glued Double Tape Liek</li>\r\n<li>PVC rounded enforcement at the ends of the cross-stuts</li>\r\n<li>Metallic-PU enforced cross-tube ends</li>\r\n<li>DP 175 LL Dacron</li>\r\n<li>Tejin T9600 Canopy</li>\r\n<li>Newly formed cross tube protections</li>\r\n<li>New plastic valve protections<br />\r\n</li></ul><strong>Sizes:</strong><br />\r\n<blockquote>   13.0 | 11.0 | 9.0 | 7.0 | 5.0 | 3.0<br />\r\n</blockquote>\r\n<div><strong>Delivery:<br />\r\n</strong>\r\n<ul>\r\n<li>Kite Passion</li>\r\n<li>Kite bag </li></ul>></p></div></div></div>','','','2016-07-19 14:11:15'),('dc581d8a115035cbfb0223c9c736f513','<div><font face=\"Verdana\" size=\"2\">Lssiges Shortsleeve fr Herren mit dem Aufdruck \"ORGANIC TO THE BONE\".</font></div>\r\n<ul>\r\n<li><font face=\"Verdana\" size=\"2\">Fair Trade Produkt <br />\r\n</font></li>\r\n<li><font face=\"Verdana\" size=\"2\">100% organic</font></li></ul>\r\n','<div>Casual short sleeve shirt for men with the imprint &quot;ORGANIC TO THE BONE&quot;. </div>\r\n<ul>\r\n<li>Fair Trade Produkt <br />\r\n</li>\r\n<li>100% organic</li></ul>','','','2016-07-19 14:11:15'),('dc5ae3d43f96269ed3c62172e383be40','<div>Lssiges Shortsleeve fr Herren mit dem Aufdruck \"ORGANIC TO THE BONE\".</div>\r\n<ul>\r\n<li>Fair Trade Produkt <br />\r\n</li>\r\n<li>100% organic</li></ul>','<div>Casual short sleeve shirt for men with the imprint \"ORGANIC TO THE BONE\". </div>\r\n<ul>\r\n<li>Fair Trade Produkt <br />\r\n</li>\r\n<li>100% organic</li></ul>','','','2016-07-19 14:11:15'),('dc5b9cfeb5bd96fdbd9b4e43974661a1','<div class=\"product_title_big\">\r\n<h2>Flysurfer Speed3</h2></div>\r\n    Noch nie war ein Kite 2 Jahre lang das\r\nMa der Dinge in Sachen Leichtwindperformance und Hangtime. Umso\r\nschwerer war es, diesen Meilenstein zu toppen.<br />\r\n<br />\r\n    Nach 12-monatiger Entwicklungszeit, der Einfhrung einer neuen\r\nKonstruktionssoftware, zahlreichen berstunden, mehr als dreifachen\r\nTestsaufwands rund um den Globus, sowie der Ergnzung des\r\nEntwicklungsteams um Andreas Hanrieder, ist es FLYSURFER gelungen, die\r\nMesslatte der Highperformance Kites mit dem SPEED3 nochmals ganz\r\ndeutlich hher zu legen.<br />\r\n<br />\r\n    Das Entwicklungsteam um Armin Harich hat mit dem SPEED3 die\r\nMesslatte in Sachen Depower, Agilitt und Stabilitt, noch mal ein\r\nganzes Stck hher gelegt!<br />\r\n    Auerdem wurde, wie bei FS blich, an vielen Details optimiert.<br />\r\n<br />\r\n<div><strong> Flugeigenschaften & Safety</strong></div><br />\r\n    Egal ob Oldschool, Bigair oder Leichtwindcruisen - der SPEED3 setzt\r\nneue Mastbe und definiert &#8222;Leistung&#8220; und Spa bei allen\r\nWindbedingungen neu.<br />\r\n<br />\r\n    Der SPEED3 zeichnet sich nach wie vor durch die legendre und\r\nunerreichte Leichtwindperformance aus. Die Barwege sind sehr direkt,\r\nleichtgngig und przise wie bei sonst keinem Kite in dieser Klasse. Die\r\n Hangtime und butterweichen Landungen suchen ihres gleichen. Noch nie\r\nwar es so einfach neue Tricks zu lernen und zu stehen egal wie viel Wind\r\n es hat.<br />\r\n<br />\r\n    Die Stabilitt ist nun auch bei starken und bigen Winden auf einem\r\nfr diese Kiteklasse unbekannten Niveau angewachsen. Dank des weiter\r\nverfeinerten Triple Depower Systems, ist der Windrange einfach\r\nunglaublich und gibt einem zustzliche Sicherheit.<br />\r\n<br />\r\n    Die Auswehfunktion erfuhr ein komplettes re-design, damit sie den\r\nvergrerten Windbereich mit abdeckt. Die gepfeilte Vorderkante\r\nermglicht nun mit nur 4 Leinen ein hervorragendes Auswehen des SPEED3\r\nan der FLS Safety mit noch guter Wiederstartbarkeit.\r\n<p><strong>&nbsp;</strong></p>\r\n<p> </p>','<div class=\"product_title_big\">\r\n<h2>Flysurfer Speed3</h2></div>\r\n<div>Never a kite was state-of-the art&nbsp;for two years&nbsp;in light wind performance and hang time. The harder to top this mile stone.</div>\r\n<div>&nbsp;</div>\r\n<div>After a 12 month development period, the introduction of a new construction software, countless overtime, more then three times of testing efforts around the globe and the enlargement of the development team around Andreas Hanrieder, FLYSERVER managed it to raise the bar of high performance kites with SPEED3 very much higher again.</div><br />\r\nAlso, as common at FLYSERVER, many details have been optimized.<br />\r\n<br />\r\n<div><strong>Flight properties and safety</strong></div><br />\r\nNo matter if old school, big air or light wind cruising - SPEED3 sets new standards redefines performance and fun at every wind circumstances.<br />\r\n<br />SPEED3 still characterizes by a legendary and unmatched light wind performance. The bar pathes are straight, smooth-running and precise like at no other kite of this range. The hang time and the soft landings are looking for their peers. It has never been that easy to learn new tricks and to stand independent of the wind strength. Thanks to the further refined triple depower system, the wind range is simply incredible and gives additional security.<br />\r\n<div><br />\r\nThe blow out function was completely re-designed to cover a wider wind range. The arrow shaped leading edge supports an outstanding blow out of the SPEED3 at the FLS safety with only 4 leashes and gives a good resistance power.</div>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>></p>','','','2016-07-19 14:11:15'),('dc5ffdf380e15674b56dd562a7cb6aec','<p><font face=\"Verdana\" size=\"2\"><strong class=\"h3\" id=\"test_productFullTitle\">Kuyichi Ledergrtel Jever</strong></font></p>\r\n<div>\r\n<p><font face=\"Verdana\" size=\"2\">&nbsp;Lssiger unisex Ledergrtel Jever von Kuychi</font></p></div>\r\n<div></div>\r\n<ul>\r\n<li>\r\n<p><font face=\"Verdana\" size=\"2\"> Schnalle mit Kuyichi-Logo <br />\r\n</font></p></li>\r\n<li>\r\n<p><font face=\"Verdana\" size=\"2\">leichter used-look</font></p></li></ul>\r\n','<strong class=\"h3\" id=\"test_productFullTitle\">Kuyichi leather belt Jever</strong>\r\n<div>&nbsp;</div>\r\n<div>Casual unisex leather belt Jever by Kuyichi</div>\r\n<ul>\r\n<li> Buckle with Kuyichi logo <br />\r\n</li>\r\n<li>slight used look</li></ul>','','','2016-07-19 14:11:15'),('ed6573c0259d6a6fb641d106dcb2faec','<div class=\"product_title_big\">\r\n<h2>Liquid Force Groove 2010</h2></div>\r\n<div>Collin Harrington ist einer der vielseitigsten Wakeboarder mit jeder Menge Style. Sein Signature-Board hat sich schon unter den schwierigsten Bedingungen bewhrt und gilt in der Szene als eines der besten Allround-Boards. </div>\r\n<div>&nbsp;</div>\r\n<div><strong>Eigenschaften:</strong></div>\r\n<ul>\r\n<li>Progressive Continuous Rocker</li>\r\n<li>Double-to-Quad concave hull configuration</li>\r\n<li>D-I-S-C through midsection into quad V concave out the tail<br />\r\n      Concaves for lift combined with V for quicker turning</li>\r\n<li>Winged scalloped tail outline - full shape with release at rail wings<br />\r\n      Allows rider to shorten the arc of his turn off the wing for slaying</li>\r\n<li>Molded Quad plus ONE fin setup<br />\r\n      long, warped sides with shallow inside fin set<br />\r\n      Outside fins for rail hold combines with inside set to control the thrust through the dual concaves</li>\r\n<li>Center Keel<br />\r\n      Center keel keeps water running though concave out the tip without getting too loose</li>\r\n<li><font size=\"1\">Variable edge rails</font></li></ul>','<div class=\"product_title_big\">\r\n<h2>Liquid Force Groove 2010</h2></div>\r\n<div>Collin Harrington is one of the most\r\n stylish and versatile riders in wakeboarding. His signature board is no\r\n different, as it performs at a high level in any situation or\r\ncondition. This board is ready to take you wherever you want to go!</div>\r\n<div>&nbsp;</div><strong>Features:</strong>\r\n<ul>\r\n<li>Progressive Continuous Rocker</li>\r\n<li>Double-to-Quad concave hull configuration</li>\r\n<li>D-I-S-C through midsection into quad V concave out the tail<br />\r\n      Concaves for lift combined with V for quicker turning</li>\r\n<li>Winged scalloped tail outline - full shape with release at rail wings<br />\r\n      Allows rider to shorten the arc of his turn off the wing for slaying</li>\r\n<li>Molded Quad plus ONE fin setup<br />\r\n      long, warped sides with shallow inside fin set<br />\r\n      Outside fins for rail hold combines with inside set to control the thrust through the dual concaves</li>\r\n<li>Center Keel<br />\r\n      Center keel keeps water running though concave out the tip without getting too loose</li>\r\n<li><font size=\"3\">Variable edge rails</font></li></ul>></p>','','','2016-07-19 14:11:15'),('ed6a2b0b90cab3f60a2dfd1c91fceb77','<div class=\"product_title_big\">\r\n<h2>ION Ballistic Slipper 1.5</h2></div>\r\n<div class=\"product_text3\">\r\n<div>2006 entwickelte ION ein innovatives Feature, die Ballistic Sohle.<br />\r\n  Sie bietet ultimativen Schutz gegen Seeigelstacheln, scharfe Muscheln, Korallenriffe und andere scharfe Dinge.<br />\r\n  &nbsp;<br />\r\n<strong>Aussenmaterialien:</strong></div>\r\n<div>\r\n<ul>\r\n<li>D Fence Nylon Jersey</li>\r\n<li>3D Flex Mesh</li>\r\n<li>Ballistic Ptotection rutschfeste Sohle</li></ul></div>\r\n<div><strong>Innenmaterialien:</strong></div>\r\n<div>\r\n<ul>\r\n<li>D Fence Nylon Jersey</li></ul></div>\r\n<div><strong>Features:</strong><br />\r\n<ul>\r\n<li>Flat Lock Stretch Nhte</li>\r\n<li>Ballistic Schutzsohle: Super widerstandsfhig gegen Seeigelstacheln, scharfe Muscheln, Korallenriffe und andere scharfe Dinge.</li>\r\n<li>Anti Slip rutschfeste Sohle: Tolles Barfugefhl und dennoch perfekte Stabilitt und Tragekomfort</li>\r\n<li>Elastischer Schnrzug auf der Vorderseite lsst sich leicht bedienen und verhindert dass Sand eindringt</li>\r\n<li>Arch Support Pad fr bessere Stabilitt </li></ul></div></div>','<div class=\"product_title_big\">\r\n<h2>ION Ballistic Slipper 1.5</h2></div>\r\n<div class=\"product_text3\">\r\n<div>In 2006, ION developed an innovative feature: the ballistic sole.<br />\r\nIt provides ultimate protection against sea urchin spines, sharp shells, corals and other sharp stuff.<br />\r\n  &nbsp;<br />\r\n<strong>Outer material:</strong></div>\r\n<div>\r\n<ul>\r\n<li>D Fence Nylon Jersey</li>\r\n<li>3D Flex Mesh</li>\r\n<li>Ballistic protection anti-slip sole</li></ul></div>\r\n<div><strong>Inner material:</strong></div>\r\n<div>\r\n<ul>\r\n<li>D Fence Nylon Jersey</li></ul></div>\r\n<div><strong>Features:</strong><br />\r\n<ul>\r\n<li>Flat Lock stretch stitchings</li>\r\n<li>Ballistic protection sole: Super resistant on&nbsp;\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\" />sea urchin spines, sharp shells, corals and other sharp stuff.</li>\r\n<li>Anti Slip sole: Perfect barefoot feeling and nonetheless perfect stability and comfort.</li>\r\n<li>Elastic cord at the front is easy to use and prevents from sand to enter.</li>\r\n<li>Arch Support Pad for better stability</li></ul>></p></div></div>','','','2016-07-19 14:11:15'),('ed6a4182ae58874e4fdaa4775566af6c','<div class=\"product_title_big\">\r\n<h2>Liquid Force S4 2010</h2></div>\r\n<div class=\"product_text3\">\r\n<div>Kein anderer Wakeboarder war\r\nerfolgreicher als Phillip Soven. Er macht zahlreiche Tricks, die sonst\r\nkeiner beherrscht. Sein neues Pro Modell hat sich in nur einer Saison zu\r\n einem der beliebtesten Boards der Szene entwickelt. Durch sein\r\ninnovatives Tail- und Findesign beit es sich extrem ins Wasser, hlt\r\ndadurch unglaublich gut auf der Kante, aber lst sich trotzdem so leicht\r\n vom Wasser wie sonst kein anderes Board. In allen Lngen auch als\r\nLimited Edition mit robuster Grindbase erhltlich.</div>\r\n<div>&nbsp;&nbsp;</div>\r\n<div class=\"MsoNormal\"><span lang=\"NL\"></span></div>\r\n<div><strong>Eigenschaften:</strong></div>\r\n<ul>\r\n<li>Progressive, 3-stage rocker<br />\r\n           Gives rider a higher trajectory arc off the wake while\r\nmaintaining a smooth flowing transition from the mid-section to the\r\ntail.</li>\r\n<li>Double concave, Quad V hull design</li>\r\n<li>D-I-S-C hull through center into deep double concaved quad V out the tail<br />\r\n           DISC for softer landings with no speed loss<br />\r\n           Concaves w/ quad V for extra lift and faster rail to rail action</li>\r\n<li>Winged scalloped tail outline - full shape with release at rail wings<br />\r\n           Allows rider to shorten the arc of his turn off the wing for slaying</li>\r\n<li>Deep molded long base side fins with cutaway trailing edge<br />\r\n           Long base for superior hold at speed, cutaway tailing edge for quicker release off the wake</li>\r\n<li>Shallow molded inside blade fins placed at top of inside V<br />\r\n           Blades control water flow through inside concave V for more control</li>\r\n<li>Centerline single vent along V at the tip<br />\r\n           Detaches water flow across centerline at end of board for increased speed</li>\r\n<li>Low volume rails with reduced area at ends<br />\r\n           Faster on edge with more hold&#8230;. Rail flex at end for more drive out of turns</li>\r\n<li>Variable edge rails</li></ul></div>','<div class=\"product_title_big\">\r\n<h2>Liquid Force S4 2010</h2></div>\r\n<div class=\"product_text3\">\r\n<div>No other wake boarder was more successful then Philip Soven. He made a number of tricks that nobody else could manage. His new professional model developed in just one season into one of the most popular boards in the scene. Due to its tail and fin design the board stands extremely good in the water, is keeping incredibly well on edge but anyway dissolves from the water like no other board. In all lenghts it is available also as limited edition with a robust grind base.</div>\r\n<div>&nbsp;&nbsp;</div>\r\n<div class=\"MsoNormal\"><span lang=\"NL\"></span></div>\r\n<div><strong>Properties:</strong></div>\r\n<ul>\r\n<li>Progressive, three stage rocker<br />\r\n           Gives rider a higher trajectory arc off the wake while\r\nmaintaining a smooth flowing transition from the mid-section to the\r\ntail.</li>\r\n<li>Double concave, Quad V hull design</li>\r\n<li>D-I-S-C hull through center into deep double concaved quad V out the tail<br />\r\n           DISC for softer landings with no speed loss<br />\r\n           Concaves w/ quad V for extra lift and faster rail to rail action</li>\r\n<li>Winged scalloped tail outline - full shape with release at rail wings<br />\r\n           Allows rider to shorten the arc of his turn off the wing for slaying</li>\r\n<li>Deep molded long base side fins with cutaway trailing edge<br />\r\n           Long base for superior hold at speed, cutaway tailing edge for quicker release off the wake</li>\r\n<li>Shallow molded inside blade fins placed at top of inside V<br />\r\n           Blades control water flow through inside concave V for more control</li>\r\n<li>Centerline single vent along V at the tip<br />\r\n           Detaches water flow across centerline at end of board for increased speed</li>\r\n<li>Low volume rails with reduced area at ends<br />\r\n           Faster on edge with more hold&#8230;. Rail flex at end for more drive out of turns</li>\r\n<li>Variable edge rails</li></ul>></p></div>','','','2016-07-19 14:11:15'),('f33d5bcc7135908fd36fc736c643aa1c','<div class=\"product_title_big\">\r\n<h2>KiteFix Glufix Tube (30g)</h2></div>\r\n<div class=\"product_text3\">Glufix ist der einzige speziell fr Kites\r\n entwickelte Klebstoff. Super strapazierfahig und flexibel, erlaubt\r\nGlufix unheimlich starke Reparaturen. Zusammen mit Fiberfix, ist es\r\nmglich mit einer Tube Glufix einen Riss von 120 cm zu reparieren.</div>\r\n<p class=\"product_text3\"><strong>&nbsp;</strong></p>\r\n<p class=\"product_text3\"> </p>','<div class=\"product_title_big\">\r\n<h2>KiteFix Glufix Tube (30g)</h2></div>\r\n<div class=\"product_text3\">Glufix is a glue specially developed for fixing kites. Super durable and flexible. With one tube of Glufix in combination with Fiberfix, you can repair a 120 cm long crack.</div>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p></p>','','','2016-07-19 14:11:15'),('f4f0cb3606e231c3fdb34fcaee2d6d04','<div class=\"product_title_big\">\r\n<h2>Liquid Force Envy - komplett</h2></div>\r\n    Felsenfeste Flugstabilitt, groe\r\nHangtime, zentraler Drehpunkt und nahezu mheloser Relaunch, das sind\r\ndie Highlights, welche den Envy am besten beschreiben. Die ultra leichte\r\n 3-Strut Konstruktion ist wie geschaffen fr einen Allround Einsatz. Der\r\n Kite liefert ein gutes Feedback an der Bar und Lenkimpulse werden\r\nunmittelbar umgesetzt.<br />\r\n<br />\r\n    Starte den Envy und es ist das letzte mal, whrend Deiner Session,\r\ndass Du Dich um den Kite kmmern musst. Die Flugcharakteristik des Envy\r\nmacht Ihn perfekt fr progressives Waveriding und Freestyle.<br />\r\n<br />\r\n    Landung misslungen? Den Kite unterfahren, beim Bottom-Turn? Mach Dir\r\n keine Gedanken, sein Design erlaubt es dem Envy, vor Dir zu schweben.\r\nDu kannst Dich voll und ganz auf Dich, Deine Tricks und Dein Board\r\nkonzentrieren.<br />\r\n<br />\r\n<div><strong>Eigenschaften:</strong></div>\r\n<div>\r\n<ul>\r\n<li>100% Depower CPR-Steuerung</li>\r\n<li>Max Flow Inflation System</li>\r\n<li>berragende Tuchqualitt</li>\r\n<li>Verstrkte Leading Edge Konstruktion</li>\r\n<li>Bridle System USB 2.0</li>\r\n<li>Diamond Wingtip</li>\r\n<li>Schrge Jet Struts</li></ul><strong>Lieferumfang:</strong><br />\r\n<ul>\r\n<li> Kite</li>\r\n<li>Tasche<br />\r\n</li>\r\n<li>Pumpe</li>\r\n<li>CPR Control System</li></ul><strong>Gren:</strong></div><strong></strong><br />\r\n    5 / 7 / 9 / 12 / 15\r\n<p><strong>&nbsp;</strong></p>\r\n<p> </p>','<div class=\"product_title_big\">\r\n<h2>Liquid Force Envy - complete</h2></div>\r\n<div>Rock solid stability in flight, great hang time, central pivot point and an almost effortless relaunch are the highlights to describe Envy best. The ultra light 3 strut construction is perfect for an allround application. The kite gives a good response at the bar and steering commands are converted immediately.</div>\r\n<div>&nbsp;</div>\r\n<div>Start your Envy and it is the last time during this session you have to care about the kite. The flight properties of Envy are perfect for progressive wave riding and free style.</div><br />\r\nLanding failed?&nbsp;Did you go under the kite at the bottom turn? Don\'t worry. Due to its design the Envy will sail in front of you. You can completely concentrate on yourself, your tricks and your board.\r\n<div><br />\r\n<div><strong>Properties:</strong></div>\r\n<div>\r\n<ul>\r\n<li>100% depower CPR-control</li>\r\n<li>Max Flow Inflation System</li>\r\n<li>Overwhelming quality of the drapery</li>\r\n<li>Enforced leading edge construction</li>\r\n<li>Bridle System USB 2.0</li>\r\n<li>Diamond Wingtip</li>\r\n<li>Slant Jet Struts</li></ul><strong>Delivery:</strong><br />\r\n<ul>\r\n<li> Kite</li>\r\n<li>Bag<br />\r\n</li>\r\n<li>Pump</li>\r\n<li>CPR Control System</li></ul><strong>Sizes:</strong></div></div>\r\n<div><strong></strong><br />\r\n    5 / 7 / 9 / 12 / 15</div>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>></p>','','','2016-07-19 14:11:15'),('f4f2d8eee51b0fd5eb60a46dff1166d8','<div class=\"product_title_big\">\r\n<h2>ION Sol Kite Waist 2011</h2></div>\r\n    Neues Damen Freestyle-Trapez mit einer\r\nschlank geschnittenen Outline fr maximale Flexibilitt. Neue\r\nGurtband-Konstruktion, Schnellverschluss und Neopren-Schutzkissen innen.\r\n Dank der elastischen Ausschnitte im hinteren Teil des Trapezes bietet\r\nes ein Maximum an Flexibilitt. Die neue Kontur Form mit Wrap Tec\r\ngarantiert eine perfekte Passform.<br />\r\n<br />\r\n<div>  <strong>Ausstattungsmerkmale:</strong></div>\r\n<ul>\r\n<li>Hip Protection<br />\r\n    Die Double-Layer-Schaumstoff-Polsterung schtzt die Knochen und alle\r\n anderen ungeschtzten Teile in diesem Bereich. Besonders, wenn der\r\nKrper&nbsp; seitlich gebeugt ist.</li>\r\n<li>Cross Link Webbing<br />\r\n    Normalerweise enden die Gurtbandenden irgendwo hinter der Schnalle.\r\nEin ununterbrochenes Gurtband entlang der Rckseite des Trapezes\r\ngarantiert eine bessere Kraftverteilung</li>\r\n<li>Internal Flex Belt<br />\r\n    Flexibler Hftgurt , sichert einen festen und bequemen Sitz des Trapezes</li>\r\n<li>Handle Pass Leash Slider<br />\r\n    Ein kleiner Metallring lsst die Leash entlang der Rckseite des Trapezes gleiten und macht Handle Pass Tricks einfacher</li>\r\n<li>Push Button Spreader Bar<br />\r\n    Der Druckknopf untersttzt die schnelle Montage des Trapezes. Es\r\nbesteht keine Notwendigkeit, alle Klettbnder an den&nbsp; Schnallen zu\r\nmontieren. Schlie einfach den Metallring in der Spreader Bar, pass das\r\nGurtband an und los geht\'s.</li>\r\n<li>Belt Garage<br />\r\n    Verhindert ein Herumfliegen des Gurtbandes</li>\r\n<li>Protection Pads<br />\r\n    Eine solide, neoprengepolsterte, Platte hlt den Trapezhaken vom Krper fern</li>\r\n<li>Contour Shape<br />\r\n    Vorgeformte Konstruktion</li>\r\n<li>Quick Fit</li>\r\n<li>Weicher Rand des Trapezes</li>\r\n<li>Wrap Tech<br />\r\n    Vorgeformte Trapezkonstruktion, die sich besser am Krper anpasst</li></ul>','<div class=\"product_title_big\">\r\n<h2>ION Sol Kite Waist 2011</h2></div>\r\n<p>New ladies free style harness with lean cut outline for maximum flexibility. New belt construction, quick release and neoprene bags inside. Thanks to the elastic cuts in the rear part of the harness, it provides a maximum in flexibility. The new Contour form with wrap tec guarantees a perfect fitting.</p>\r\n<div>&nbsp;</div>\r\n<div>\r\n<div><strong>Properties:</strong></div>\r\n<ul>\r\n<li>Hip protection<br />\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\" />The double layer foam padding protects the bones and all unprotected parts in this area, especially if the body is flexed to the side.</li>\r\n<li>Cross Link Webbing<br />\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\" />Usually, the belt ends somewhere behind the buckle. A belt without cease along the rear side of the harness guarantees a better load balancing.</li>\r\n<li>Internal Flex Belt<br />\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\" />Flexible hip belt. Backs a safe, straight and comfortable seat of the harness.</li>\r\n<li>Handle Pass Leash Slider<br />\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\" />A small ring of metal can slip the leash along the back of the harness and makes handle pass tricks easier.</li>\r\n<li>Push Button Spreader Bar<br />\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\" />The push button supports the quick assembly of the harness. There is no need to assemble all velcro strips at the buckle. Simply close the metal ring in the spreader bar, adjust the belt and - here we go!</li>\r\n<li>Belt Garage<br />\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\" />Prevents from loose tottering of the belt.</li>\r\n<li>Protection Pads<br />\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\" />A solid, neoprene padded board that keeps the harness hook away from the body.</li>\r\n<li>Contour Shape<br />\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\" />preformed construction</li>\r\n<li>Quick Fit</li>\r\n<li>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\" />Soft edges </li>\r\n<li>Wrap Tech<br />\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\" />preformed construction of the harness that better fits the body.</li></ul>></p></div>','','','2016-07-19 14:11:15'),('f4f73033cf5045525644042325355732','<p>Praktischer, leichter und faltbarer Transportcontainer.</p>\r\n<p>\r\nWenn man ihn nicht braucht kann man ihn platzsparend\r\neinschrumpfen. Ob fr schmutzige Wsche, nasse Surfklamotten, khle\r\nGetrnke am Strand oder einfach als coolen Stauraum, nur mit einem Griff\r\n baut sich der Container durch die Pop-Up-Mechanik selbst auf.<br />\r\n<br />\r\n       Sehr gut verarbeitet und mit stabilen Tragegriffen und Doppelwand\r\n ist der Container wasserdicht, isoliert und durch eine\r\nReisverschlussklappe zu verschlieen.</p>\r\n<p><strong>Hinweis:</strong> Der Container kann individuell nach Ihren Wnschen bedruckt werden. Geben Sie den gewnschten Text einfach in das dafr vorgesehene Feld ein. <br />\r\n<br /><strong>Mae:</strong></p>\r\n<ul>\r\n<li>Hhe: 12cm (geschlossen), 43cm (offen) <br />\r\n</li>\r\n<li>Durchmesser: 42cm</li></ul><!--[if gte mso 9]>\r\n<xml>\r\n<w:worddocument>\r\n<w:view>Normal</w:view>\r\n<w:zoom>0</w:zoom>\r\n<w:trackmoves/>\r\n<w:trackformatting/>\r\n<w:hyphenationzone>21</w:hyphenationzone>\r\n<w:punctuationkerning/>\r\n<w:validateagainstschemas/>\r\n<w:saveifxmlinvalid>false</w:saveifxmlinvalid>\r\n<w:ignoremixedcontent>false</w:ignoremixedcontent>\r\n<w:alwaysshowplaceholdertext>false</w:alwaysshowplaceholdertext>\r\n<w:donotpromoteqf/>\r\n<w:lidthemeother>DE</w:lidthemeother>\r\n<w:lidthemeasian>X-NONE</w:lidthemeasian>\r\n<w:lidthemecomplexscript>X-NONE</w:lidthemecomplexscript>\r\n<w:compatibility>\r\n<w:breakwrappedtables/>\r\n<w:snaptogridincell/>\r\n<w:wraptextwithpunct/>\r\n<w:useasianbreakrules/>\r\n<w:dontgrowautofit/>\r\n<w:splitpgbreakandparamark/>\r\n<w:dontvertaligncellwithsp/>\r\n<w:dontbreakconstrainedforcedtables/>\r\n<w:dontvertali