><span lang=\"EN-US\">www.mikejucker.com</span></a><span style=\"color: black\" lang=\"EN-US\">.</span><span lang=\"EN-US\"></span></p></div>','','','2016-07-19 14:11:15'),('f4f981b0d9e34d2aeda82d79412480a4','<div class=\"product_title_big\">\r\n<h2>Triggernaut Agent Orange</h2></div>\r\n<div>Was haben orangene Agenten und\r\nbrauner Zucker gemeinsam? Wahrscheinlich nichts, auer, dass es bei\r\nTriggernaut zwei stylische Brillenmodelle gleichen Namens gibt. Agent\r\nOrange und Brown Sugar sind zwei formschne Sonnenbrillen fr Mnner und\r\n Frauen, die wissen was sie wollen. Die Brillen sind im klassischen\r\nSchwarz oder Dunkelbraun erhltlich. Die Innenseiten der Brillen haben\r\neine andere Farbe als die Auenseite, was auch beim Tragen der Brillen\r\neinen schnen Akzent setzt. Der Rahmen der Brillen ist aus Polyamid\r\ngefertigt. Splitterfreie Polykarbonat-Glser sorgen fr ein Maximum an\r\nSicherheit, auch im Grostadtdschungel. Die Agent Orange und Brown Sugar\r\n sind fr normal groe Kpfe gut geeignet. <br />\r\n<br />\r\n   Der Rahmen der Brillen ist aus Polyamid gefertigt. Splitterfreie\r\nPolykarbonat-Glser sorgen fr ein Maximum an Sicherheit, auch im\r\nGrostadtdschungel. Die Kunststoffglser sind klteelastisch und bieten\r\neinen 100%igen UV-A und UV-B Schutz.<br />\r\n   Die Glser erfllen sowohl die C-Norm fr Sonnenbrillen zur\r\nallgemeinen Anwendung, den European Standard (EN 1836) sowie die\r\nANSI-Norm (Z80.3) fr Bruchfestigkeit, optische Genauigkeit und\r\nFarbabstimmung als auch den strengen Australian /New Zealand Standard AS\r\n (NZS1067).<br />\r\n   Alle von Triggernaut verwendeten Glser sind verkehrstauglich. Alle\r\nFarben (auch Signalfarben) werden natrlich wiedergegeben.</div>\r\n<div>&nbsp;</div>\r\n<div>Jede Triggernaut Brille aus der Style Series wird in einem\r\nstylischen Brillencase und mit einem Microfaser-Softbag ausgeliefert.&nbsp; </div>\r\n<p><strong>&nbsp;</strong></p>\r\n<p> </p>','<div class=\"product_title_big\">\r\n<h2>Triggernaut Agent Orange</h2></div>\r\n<div>What did orange agents and brown sugar together? Probably nothing except that you may get two stylish glass modells with the same name at Triggernaut. Agent Orange and Brown Sugar are two well designed sun glasses for men and women that know what they want. You may purchase the glasses in classic black or dark brown. The insides of the glasses have a different color then the outside which makes a great accent while wearing them. The frames of the glasses are made of polyamide. Shatter-free plycarbonate lenses provide a maximum of security even in the urban jungle. Agent Orange and Brown Sugar are suitable for normal sized heads.</div>\r\n<div>&nbsp;</div>\r\n<div>The plastic glasses are cold-elastic and offer a 100% UV-A and UV-B protection.&nbsp;The glasses meet the C  standard for sunglasses for general use, the European Standard (EN 1836) and the ANSI standard (Z80.3) for breaking strength, visual accuracy and color matching as well as the strict Australian / New Zealand Standard AS ( NZS1067). All Triggernaut glasses are roadworthy. All colors (light colors) of course are displayed.</div>\r\n<div>&nbsp;</div>\r\n<div>All Triggernaut glasses of the style series will be delivered in a stylish case and a micro fiber soft bag.</div>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>></p>','','','2016-07-19 14:11:15'),('f4fc98f99e3660bd2ecd7450f832c41a','<div class=\"product_title_big\">\r\n<h2>NPX Assassin Semidry 5/4/3 E3 2011</h2></div>\r\n<div>Der NPX Assassin ist ein Neoprenanzug fr Mnner mit sehr gutem Preis-Leistungs-Verhltnis. Hochwertig verarbeitet und sehr bequem zu tragen. Ein aufflliges Design soll vor allem auch die\r\njngere Generation ansprechen. </div><br />\r\n<div><strong>Konstruktion:</strong></div>\r\n<ul>\r\n<li>Apex-Mesh</li>\r\n<li>Apex-Flex</li>\r\n<li>Hot cell</li>\r\n<li>Bambus Charcoal<br />\r\n</li></ul>\r\n<div><strong>Ausstattungsmerkmale:</strong></div>\r\n<ul>\r\n<li>&#8222;Wrap around&#8220; Halsmanschette</li>\r\n<li>Aquavents</li>\r\n<li>P-Skin versiegelte Nhte</li>\r\n<li>E3 Einstiegssystem</li>\r\n<li>GBL Nhte</li>\r\n<li>Elastische Schlsselschlaufe innen im Rckenbereich</li>\r\n<li>Klett-Befestigung fr das Reiverschluss-Gurtband</li>\r\n<li>PU Kniepolster</li>\r\n<li>Schlaufen im Knchelbereich</li>\r\n<li>Abnehmbare Beinmanschetten</li></ul>','<div class=\"product_title_big\">\r\n<h2>NPX Assassin Semidry 5/4/3 E3 2011</h2></div>\r\n<div>Assassin is fully equipped for unlimited radical free moving space with a heat insulating Hotcell isolation, Aquavents and other brilliant feature. It keeps you warm while you can concentrate on the important stuff.</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Contruction:</strong></div>\r\n<ul>\r\n<li>Apex-Mesh</li>\r\n<li>Apex-Flex</li>\r\n<li>Hot cell</li>\r\n<li>Bamboo Charcoal<br />\r\n</li></ul>\r\n<div><strong>Properties:</strong></div>\r\n<ul>\r\n<li>&#8222;Wrap around&#8220; neck brace</li>\r\n<li>Aquavents</li>\r\n<li>P-Skin sealed stitchings</li>\r\n<li>E3 entry system</li>\r\n<li>GBL stitchings</li>\r\n<li>Elastic key loop inside in the back area</li>\r\n<li>VELCRO attachment for the zipper strap</li>\r\n<li>PU knee pads</li>\r\n<li>Straps around the ankles</li>\r\n<li>Removable leg cuffs</li></ul>></p>','','','2016-07-19 14:11:15'),('f4fe052346b4ec271011e25c052682c5','<div class=\"product_title_big\">\r\n<h2>Core Kiteboarding GT - nur Kite</h2></div>\r\n<div class=\"product_text3\">\r\n<div>All in one - das gilt beim GT\r\nwortwrtlich: ein Delta, der vom Shape an einen C-Kite erinnert und\r\neinige Eigenschaften eines Bows aufweist. Der neue Delta-Kite von CORE\r\nbesticht durch seine unglaubliche Ausgewogenheit und Performance.</div>\r\n<div>Die gelungene Synthese aus Delta-, Bow- und C-Kite vereint alle positiven Eigenschaften der jeweiligen Systeme.</div>\r\n<div><br />\r\n<strong>Eigenschaften:</strong></div>\r\n<div>\r\n<ul>\r\n<li>Der GT besitzt das Low-End eines CORE RIOT und verfgt ber mehr\r\nSprungpower als sein Stallkollege. In puncto Wendigkeit und High-End\r\nhnelt er Wave Kites. Die explosive Kraftentfaltung und das\r\neinzigartige, uerst direkte Barfeeling des GT sucht seinesgleichen.</li>\r\n<li>Der GT kann vllig drucklos an den beiden Frontleinen auswehen, die Fnfte Leine ist damit nicht mehr notwendig.</li>\r\n<li>Der GT ist fr Freestyler, Freerider oder Wakestyler gleichermaen\r\ngeeignet. Anfnger genauso wie echte Profis und Contestfahrer werden\r\nFreude an diesem Kite haben.</li>\r\n<li>Problemloser \"Auto-Relaunch\" ? selbstverstndlich auch in tiefem Wasser.</li>\r\n<li>Servicefreundliches Fast-Pump-System.</li>\r\n<li>Eine Bar fr alle Kites.<br />\r\n</li></ul><strong>Lieferumfang:</strong><br />\r\n<ul>\r\n<li>Kite-only, incl. Kite-Backpack</li>\r\n<li>RepairKitPro</li></ul></div></div>','<div class=\"product_title_big\">\r\n<h2>Core Kiteboarding GT - Kite only</h2></div>\r\n<div class=\"product_text3\">\r\n<div>All in one - this is literally meant for GT: a Delta that reminds to a c-kite from its shape and has some properties of a Bow. The new delta kite by CORE boasts an amazing balance and performance.</div>\r\n<div>The successful synthesis of delta-, bow-and C-kite combines all the positivecharacteristics of each system.</div>\r\n<div><br />\r\n<strong>Properties:</strong></div>\r\n<div>\r\n<ul>\r\n<li>GT has the low end of the CORE RIOT and has more jump power of his stable mate. In terms of maneuverablity and high end it resembles wave kites.&nbsp;\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\" />The explosive power development and the unique very direct bar feeling of the GT looks for his peers.</li>\r\n<li>GT can blow out on both front leashes completely pressure-less, the fifth leash is not needed</li>\r\n<li>GT is for free stylers, free riders or wake stylers. Beginners as well as experts or contest riders will have fun with this kite.</li>\r\n<li>Effortless auto relaunch, of course in deep water as well.</li>\r\n<li>Service friendly fast pump system.</li>\r\n<li>One bar for all kites.<br />\r\n</li></ul><strong>Delivery:</strong><br />\r\n<ul>\r\n<li>Kite only, incl. Kite backpack</li>\r\n<li>Repair Kit Pro</li></ul>></p></div></div>','','','2016-07-19 14:11:15'),('f4fe754e1692b9f79f2a7b1a01bb8dee','<div class=\"product_title_big\">\r\n<h2>RRD Toxic Wave2</h2></div>\r\n<div class=\"product_text3\">\r\n<div>Das Toxic kombiniert eine Surfboard\r\nOutline mit dem vorteilhaften Twintip Fahrverhalten. Du kannst sogar\r\nrckwrts fahren um durch das Line Up zu kommen, obwohl du dabei auf\r\neinem gerundeten Rail und einer angehoben Nose fhrst. Die perfekte Wahl\r\n fr auflandige Bedingungen.</div>\r\n<div>Das Board hat eine andere Bautechnologie, eine komplett neue Out-\r\nund Rockerline und ist geeigneter denn je fr Leichtwind und kleinere\r\nWellen &#8211; ein verlsslicher Name und bewhrte Performance mit einem neuen\r\n Konzept. </div>\r\n<div>&nbsp;</div>\r\n<div><strong>Technologie:</strong> Vollholz/Biaxial/ABS Seitenwnde/DC/DC </div>\r\n<div>&nbsp;</div>\r\n<div><strong>Gre </strong>158 x 44 cm</div>\r\n<div>     <strong>Pads </strong>TT HP moulded</div>\r\n<div>     <strong>Schlaufen </strong>Screw-IT System Neo</div>\r\n<div>     <strong>Finnen </strong>3 x Toxic Wave Finnen 6.5 + 2 x Nose Toxic 4 G-10</div>\r\n<p><strong>&nbsp;</strong></p>\r\n<p> </p></div>','<div class=\"product_title_big\">\r\n<h2>RRD Toxic Wave2</h2></div>\r\n<div class=\"product_text3\">\r\n<div>Toxic combines a surfboard outline with the advantages of twin-tip driving. You can even ride backwards to come through the line up although you will go on a rounded rail and a lifted nose. The perfect choice for onshore conditions. The board has another construction technology, a different out and rocker line and is suitable for light wind and small waves. A reliable name and proven performance with a new concept.</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Technology:</strong> Massiv wood / Biaxial / ABS side walls / DC / DC </div>\r\n<div>&nbsp;</div>\r\n<div><strong>Size&nbsp;</strong>158 x 44 cm</div>\r\n<div>     <strong>Pads </strong>TT HP moulded</div>\r\n<div>     <strong>Loops&nbsp;</strong>Screw-IT System Neo</div>\r\n<div>     <strong>Fins&nbsp;</strong>3 x Toxic Wave Fins 6.5 + 2 x Nose Toxic 4 G-10</div>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>></p></div>','','','2016-07-19 14:11:15'),('fad21eb148918c8f4d9f0077fedff1ba','<div class=\"product_title_big\">\r\n<h2>Liquid Force Havoc - komplett</h2></div>\r\n<div class=\"product_text3\">\r\n<p>Traumhafte Sessions &#8211; das ist alles\r\nworum es beim Havoc geht. Seit  Jahren steht der Havoc als Synonym fr\r\nGeschwindigkeit, Stabilitt und  Vielseitigkeit, und auch die fnfte\r\nGeneration macht da keinen  Unterschied. </p>\r\n<p>Durch gleichmiges und direktes Drehverhalten bei bewusst gefhlter\r\n Kraftentwicklung ist der Havoc die natrliche Wahl fr alles, vom\r\nprogressiven Freestyle und Wakestyle, bis hin zu Action geladenem\r\nWellenreiten. Blitzschnelles Drehen und gleichmiger Lift machen diesen\r\n  Kite zur Antwort auf massive Airs, schnelle kontrollierte Loops und\r\nvorhersehbare Platzierung im Windfenster.</p>\r\n<p>Die Diamond Wingtips und das 2.0 Bridal System sorgen fr\r\nunbertroffene Windrange und przise Reaktion um grandioses unhooked\r\nRiding zu ermglichen. Kein Stress, wenn der Kite mal ins Wasser fllt\r\nwhrend Du neue Tricks lernst: Die Relaunch-Fhigkeiten des Havoc\r\nbringen den Kite so mhelos und schnell wieder in die Luft bevor Du\r\nrealisiert hast, dass Du berhaupt im Wasser lagst. </p>\r\n<div>\r\n<div><strong>Eigenschaften:</strong></div>\r\n<ul>\r\n<li>100% Depower CPR-Steuerung</li>\r\n<li>Max Flow Inflation System</li>\r\n<li>berragende Tuchqualitt</li>\r\n<li>Verstrkte Leading Edge Konstruktion</li>\r\n<li>Bridle System USB 2.0</li>\r\n<li>Diamond Wingtip</li>\r\n<li>Schrge Jet Struts <br />\r\n</li></ul></div>\r\n<div><strong>Lieferumfang:</strong><br />\r\n</div>\r\n<div>\r\n<ul>\r\n<li> Kite</li>\r\n<li>Tasche<br />\r\n</li>\r\n<li>Pumpe</li>\r\n<li>CPR Control System</li></ul><strong>Gren: </strong><br />\r\n<br />\r\n   6 / 8 / 10 / 12 / 14 / 16</div>\r\n<p><strong>&nbsp;</strong></p>\r\n<p> </p></div>','<h2>Liquid Force Havoc </h2>\r\n<p>Producing sessions that dreams are made of is what the Havoc is all\r\nabout. Over the years the Havoc has been a kite synonymous with speed,\r\nstability and versatility; the fifth generation differs none. The Havoc\r\noffers smooth, deliberate power and responsive direct turning that makes\r\n it a natural choice for everything from progressive freestyle and wake\r\nstyle to fast action wave riding. Lightning quick turning and smooth\r\nlift make this kite the answer for massive air, fast controlled loops\r\nand predictable placement in the wind window.&nbsp; </p>\r\n<div>\r\n<div><strong>Facts:</strong></div>\r\n<ul>\r\n<li>100% Depower CPR Control System Equipped<br />\r\n</li>\r\n<li>Max Flow Inflation System</li>\r\n<li>Superior Quality Canopy Material<br />\r\n</li>\r\n<li>Reinforced Leading Edge Structure</li>\r\n<li>Bridle System USB 2.0</li>\r\n<li>Diamond Wingtip</li>\r\n<li>Angled Jet Struts <br />\r\n</li></ul></div>\r\n<div><strong>Purchased parts package</strong><strong>:</strong><br />\r\n</div>\r\n<div>\r\n<ul>\r\n<li> Kite</li>\r\n<li>Backpack<br />\r\n</li>\r\n<li>Pump</li>\r\n<li>CPR Control System</li></ul><strong>Sizes: </strong><br />\r\n<br />\r\n   6 / 8 / 10 / 12 / 14 / 16</div>\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>></p>','','','2016-07-19 14:11:15'),('fadc492a5807c56eb80b0507accd756b','<div class=\"product_title_big\">\r\n<h2>Spleene SP-X 2010 - nur Kite</h2></div>\r\n<div>Egal ob New School, Hangtime, Wave,\r\noder Freeride, der SP-X ist ein wahrer All Terrain Kite. Kinderleichtes\r\nHandling sowie leichte Steuer- und Barkrfte ermglichen ausgiebige\r\nSessions. Der starke Lift wird Sie in neue Hhen tragen. Ein extrem\r\nschneller und einfacher Wasserstart gibt Ihnen die Sicherheit immer neue\r\n Sachen zu probieren.</div>\r\n<div>&nbsp;</div>\r\n<div>Apropos Sicherheit, der Kite hat ein berragendes Depowerverhalten\r\nund gibt Ihnen einen enorm groen nutzbaren Windbereich. Die Depower\r\nverhlt sich ber den gesamten Weg immer linear. Sie wissen also zu\r\njedem Zeitpunkt wo sich der Kite gerade im Windfenster befindet. </div>\r\n<div>&nbsp;</div>\r\nEs wird gerne von C-Kite-Feeling gesprochen, der SP-X hat es\r\ndefinitiv. Nur ist er viel einfacher und kraftsparender zu fahren. Die\r\nVerarbeitung ist nur mit besten Materialien, sowie zahlreichen Kevlar\r\nVerstrkungen an den Stresszonen ausgefhrt. Dabei hat Spleene besonders\r\n darauf geachtet, dass der Kite sehr leicht und somit agil bleibt. Durch\r\n das gewohnt zuverlssige One-Point-Inflation System von Spleene ist der\r\n Kite schnell auf- und abgebaut.Testen Sie ihn aus und erleben Sie das\r\nneue Gefhl!!!<br />\r\n<br /><strong>Eigenschaften:</strong><br />\r\n<ul>\r\n<li>unbeatable windrange</li>\r\n<li>awesome unhooked performance</li>\r\n<li>massive vertical boost</li>\r\n<li>foolproof water relaunch</li>\r\n<li>one point inflation system</li>\r\n<li>4-line setup</li></ul><strong>Lieferumfang:</strong> SP-X Kite only & Bag\r\n<p><strong>&nbsp;</strong></p>\r\n<p> </p>','<div class=\"product_title_big\">\r\n<h2>Spleene SP-X 2010 - Kite only</h2></div>\r\n<div>No matter if new school, hang time, wave or free ride: the SP-X is a real all-terrain kite.&nbsp;Dead easy handling as well as easy control and bar forces manage never-ending session. The powerful lift will take you to new heights. An extremely quick and easy start on water gives you the security to try out new things.</div>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\" />\r\n<div>&nbsp;</div>\r\n<div>Speaking of security: the kite has an outstanding depower behavior and uses an enormous big wind area. &nbsp;The depower behaves linear over the entire path. Thus you know at every time where the kite is in the wind.</div>\r\n<div>&nbsp;</div>\r\n<div>People love to talk about c kite feeling, the SP-X has got it definitely. But it is to ride much easier and more power saving.&nbsp;It is manufactured with the best materials only countless Kevlar enforcements in the stress zones. Spleen especially took care that the kite is light weight and agile. By the usual reliable one point inflation system by Spleen the kite can quickly be assembled or de-assembled. Check it and get the new feeling!</div>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=utf-8\" /><br />\r\n<strong>Properties:</strong><br />\r\n<ul>\r\n<li>unbeatable wind range</li>\r\n<li>awesome unhooked performance</li>\r\n<li>massive vertical boost</li>\r\n<li>foolproof water relaunch</li>\r\n<li>one point inflation system</li>\r\n<li>4-line setup</li></ul><strong>Delivery:</strong> SP-X Kite only & Bag\r\n<p class=\"MsoNormal\"><strong>&nbsp;</strong></p>></p>','','','2016-07-19 14:11:15'),('fc71f70c3398ee4c2cdd101494087185','<p>Aus diversen Marken-Stickern werden 10 zufllig ausgewhlt. Lasst euch berraschen...&nbsp; </p>','Random selection of 10 brand-stickers. Let yourself be surprised... <br />','','','2016-07-19 14:11:15'),('oiaa81b5e002fc2f73b9398c361c0b97','<p>Dieses Produkt ist ein Downloadartikel. Legen Sie diesen Artikel in den Warenkorb und fhren Sie eine Bestellung aus um zu sehen, wie das Feature \"Downloadartikel\" funktioniert. Sie erhalten eine E-Mail mit einem Downloadlink zur Leseprobe aus dem Kapitel 3 des O\'Reilly-Buches \"Online-Shops mit OXID eShop\". Natrlich bietet dieses Feature vielfltige Einstellungsmglichkeiten.</p> <p><b>Bezugshinweis:</b> <br> Bei Interesse knnen Sie das Buch <a href=\"http://www.oreilly.de/buecher/120054/9783955617769-online-shops-mit-oxid-eshop.html\" target=\"_blank\">Online-Shops mit OXID eShop beim O\'Reilly-Verlag bestellen</a>.</p>','<p>This product is downloadable. Please put it to the cart and follow the checkout process to see how the feature \"Downloadable Product\" works. You\'ll get an email with a download link to the German extract of chapter 3 of the O\'Reilly book \"Online shops with OXID eShop\". Of course, this feature provides versatile options.</p> <p><b>Reference note:</b> <br> If you are interested you can purchase the book <a href=\"http://www.oreilly.de/catalog/pdf_onlineshopsoxidger\" target=\"_blank\">Online shops with OXID eShop at O\'Reilly\'s</a>. Please note that this book is available in German language only.</p>','','','2016-12-15 15:49:25');
