LOCK TABLES `oxcontents` WRITE;
/*!40000 ALTER TABLE `oxcontents` DISABLE KEYS */;
INSERT INTO `oxcontents` VALUES ('1074279e67a85f5b1.96907412','oxorderinfo',1,1,0,1,1,'','Wie bestellen?','<div>Beispieltext:</div>\r\n<div></div>\r\n<div>[{ $oxcmp_shop->oxshops__oxname->value }], Ihr Online-Shop fr ... <br />\r\n<br />\r\nBei uns haben Sie die Wahl aus mehr als ... Artikeln von bester Qualitt und namhaften Herstellern. Schauen Sie sich um, stbern Sie in unseren Angeboten! <br />\r\n[{ $oxcmp_shop->oxshops__oxname->value }] steht Ihnen im Internet rund um die Uhr und 7 Tage die Woche offen.<br />\r\n<br />\r\nWenn Sie eine Bestellung aufgeben mchten, knnen Sie das:\r\n<ul>\r\n<li class=\"font11\">direkt im Internet ber unseren Shop </li>\r\n<li class=\"font11\">per Fax unter[{ $oxcmp_shop->oxshops__oxtelefax->value }] </li>\r\n<li class=\"font11\">per Telefon unter [{ $oxcmp_shop->oxshops__oxtelefax->value }] </li>\r\n<li class=\"font11\">oder per E-Mail unter <a href=\"mailto:[{ $oxcmp_shop->oxshops__oxowneremail->value }]?subject=Bestellung\"><strong>[{ $oxcmp_shop->oxshops__oxowneremail->value }]</strong></a> </li></ul>Telefonisch sind wir fr Sie <br />\r\nMontag bis Freitag von 10 bis 18 Uhr erreichbar. <br />\r\nWenn Sie auf der Suche nach einem Artikel sind, der zum Sortiment von [{ $oxcmp_shop->oxshops__oxname->value }] passen knnte, ihn aber nirgends finden, lassen Sie es uns wissen. Gern bemhen wir uns um eine Lsung fr Sie. <br />\r\n<br />\r\nSchreiben Sie an <a href=\"mailto:[{ $oxcmp_shop->oxshops__oxowneremail->value }]?subject=Produktidee\"><strong>[{ $oxcmp_shop->oxshops__oxowneremail->value }]</strong></a>.</div>','How to order?','<h1>Text Example</h1>\r\n<h2>[{ $oxcmp_shop->oxshops__oxname->value }], your online store for ...</h2>\r\n<p>With us, you can choose from more than ... products of high quality and reputable manufacturers. Take a look around and browse through our offers!<br />\r\nOn the internet [{ $oxcmp_shop->oxshops__oxname->value }] is open 24/7.</p>\r\n<p>If you want to place an order you can purchase</p>\r\n<ul>\r\n<li class=\"font11\">via our online store</li>\r\n<li class=\"font11\">via fax [{ $oxcmp_shop->oxshops__oxtelefax->value }] </li>\r\n<li class=\"font11\">via telephone [{ $oxcmp_shop->oxshops__oxtelefax->value }] </li>\r\n<li class=\"font11\">or via e-mail <a href=\"mailto:[{ $oxcmp_shop->oxshops__oxowneremail->value }]?subject=Order\"><strong>[{ $oxcmp_shop->oxshops__oxowneremail->value }]</strong></a></li></ul>\r\n<p>By telephone, we are available<br />\r\nMonday to Friday 10 AM thru 6 PM. </p>\r\n<p>If you are looking for an item that did not match the range of [{ $oxcmp_shop->oxshops__oxname->value }], let\'s us know. We are happy to find a solution for you.</p>\r\n<p>Write to <a href=\"mailto:[{ $oxcmp_shop->oxshops__oxowneremail->value }]?subject=Product idea\"><strong>[{ $oxcmp_shop->oxshops__oxowneremail->value }]</strong></a></p>',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2017-12-21 11:27:11'),('1544167b4666ccdc1.28484600','oxblocked',1,1,0,1,1,'','Benutzer geblockt','<div><span style=\"color: #ff0000;\"><strong>Der Zugang wurde Ihnen verweigert!</strong></span></div>\r\n<div> </div>\r\n<div> </div>','user blocked','<div>\r\n   <span style=\"color: #ff0000;\"><strong>Permission denied!</strong></span>\r\n</div>',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2017-12-21 11:27:11'),('1ea45574543b21636.29288751','oxrightofwithdrawal',1,1,0,1,1,'','Widerrufsrecht','<div>Fgen Sie hier Ihre Widerrufsbelehrung ein.</div><div><a title=\'\' href=\'[{->getBaseDir()}]out/pictures/ddmedia/create_your_withdrawal_pdf_here_de.pdf\'><strong>Muster fr das Widerrufsformular</strong></a></div>','Right of Withdrawal','<div>Insert here the Right of Withdrawal policy.</div><div><strong><a title=\'\' href=\'[{->getBaseDir()}]out/pictures/ddmedia/create_your_withdrawal_pdf_here_en.pdf\'>Model form for withdrawal</a></strong></div>',1,'','',0,'','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2017-12-21 11:27:11'),('220404cee0caf470e227c1c9f1ec4ae2','oxrighttocancellegend',1,1,0,1,1,'','AGB und Widerrufsrecht','[{oxifcontent ident=\"oxagb\" object=\"oCont\"}]\r\n    Ich habe die <a id=\"test_OrderOpenAGBBottom\" rel=\"nofollow\" href=\"[{ $oCont->getLink() }]\" onclick=\"window.open(\'[{ $oCont->getLink()|oxaddparams:\"plain=1\"}]\', \'agb_popup\', \'resizable=yes,status=no,scrollbars=yes,menubar=no,width=620,height=400\');return false;\" class=\"fontunderline\">AGB</a> gelesen und erklre mich mit ihnen einverstanden.&nbsp;\r\n[{/oxifcontent}]\r\n[{oxifcontent ident=\"oxrightofwithdrawal\" object=\"oCont\"}]\r\n    Ich wurde ber mein <a id=\"test_OrderOpenWithdrawalBottom\" rel=\"nofollow\" href=\"[{ $oCont->getLink() }]\" onclick=\"window.open(\'[{ $oCont->getLink()|oxaddparams:\"plain=1\"}]\', \'rightofwithdrawal_popup\', \'resizable=yes,status=no,scrollbars=yes,menubar=no,width=620,height=400\');return false;\">[{ $oCont->oxcontents__oxtitle->value }]</a> informiert.\r\n[{/oxifcontent}]','Terms and Conditions and Right to Withdrawal','[{oxifcontent ident=\"oxagb\" object=\"oCont\"}] I agree to the <a id=\"test_OrderOpenAGBBottom\" rel=\"nofollow\" href=\"[{ $oCont->getLink() }]\" onclick=\"window.open(\'[{ $oCont->getLink()|oxaddparams:\"plain=1\"}]\', \'agb_popup\', \'resizable=yes,status=no,scrollbars=yes,menubar=no,width=620,height=400\');return false;\" class=\"fontunderline\">Terms and Conditions</a>.&nbsp;\r\n[{/oxifcontent}]\r\n[{oxifcontent ident=\"oxrightofwithdrawal\" object=\"oCont\"}]\r\n    I have been informed about my <a id=\"test_OrderOpenWithdrawalBottom\" rel=\"nofollow\" href=\"[{ $oCont->getLink() }]\" onclick=\"window.open(\'[{ $oCont->getLink()|oxaddparams:\"plain=1\"}]\', \'rightofwithdrawal_popup\', \'resizable=yes,status=no,scrollbars=yes,menubar=no,width=620,height=400\');return false;\">[{ $oCont->oxcontents__oxtitle->value }]</a>.\r\n[{/oxifcontent}]',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2017-12-21 11:27:11'),('220404cee0caf470e227c1c9f1ec4ae3','oxrighttocancellegend2',1,1,0,1,1,'','AGB und Widerrufsrecht','[{oxifcontent ident=\"oxagb\" object=\"oCont\"}]\r\n    Es gelten unsere <a rel=\"nofollow\" href=\"[{ $oCont->getLink() }]\" onclick=\"window.open(\'[{ $oCont->getLink()|oxaddparams:\"plain=1\"}]\', \'agb_popup\', \'resizable=yes,status=no,scrollbars=yes,menubar=no,width=620,height=400\');return false;\" class=\"fontunderline\">Allgemeinen Geschftsbedingungen</a>.&nbsp;\r\n[{/oxifcontent}]\r\n[{oxifcontent ident=\"oxrightofwithdrawal\" object=\"oCont\"}]\r\n    Hier finden Sie <a id=\"test_OrderOpenWithdrawalBottom\" rel=\"nofollow\" href=\"[{ $oCont->getLink() }]\" onclick=\"window.open(\'[{ $oCont->getLink()|oxaddparams:\"plain=1\"}]\', \'rightofwithdrawal_popup\', \'resizable=yes,status=no,scrollbars=yes,menubar=no,width=620,height=400\');return false;\">Einzelheiten zum Widerrufsrecht</a>.\r\n[{/oxifcontent}]','Terms and Conditions and Right to Withdrawal','[{oxifcontent ident=\"oxagb\" object=\"oCont\"}] Our general <a rel=\"nofollow\" href=\"[{ $oCont->getLink() }]\" onclick=\"window.open(\'[{ $oCont->getLink()|oxaddparams:\"plain=1\"}]\', \'agb_popup\', \'resizable=yes,status=no,scrollbars=yes,menubar=no,width=620,height=400\');return false;\" class=\"fontunderline\">terms and conditions</a> apply.&nbsp;\r\n[{/oxifcontent}]\r\n[{oxifcontent ident=\"oxrightofwithdrawal\" object=\"oCont\"}]\r\n    Read details about  <a id=\"test_OrderOpenWithdrawalBottom\" rel=\"nofollow\" href=\"[{ $oCont->getLink() }]\" onclick=\"window.open(\'[{ $oCont->getLink()|oxaddparams:\"plain=1\"}]\', \'rightofwithdrawal_popup\', \'resizable=yes,status=no,scrollbars=yes,menubar=no,width=620,height=400\');return false;\">right of withdrawal</a>.\r\n[{/oxifcontent}]',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2017-12-21 11:27:11'),('220404cee0caf470e227c1c9f1ec4aL3','oxdownloadableproductsagreement',1,1,0,1,1,'','Fr digitale Inhalte','Ja, ich mchte sofort Zugang zu dem digitalen Inhalt und wei, dass mein Widerrufsrecht mit dem Zugang erlischt.','For the supply of digital content','I want immediate access to the digital content and I acknowledge that thereby I lose my right to cancel once the service has begun.',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2017-12-21 11:27:11'),('220404cee0caf470e227c1c9f1ec4aL4','oxserviceproductsagreement',1,1,0,1,1,'','Fr Dienstleistungen','Ja, bitte beginnen Sie sofort mit der Dienstleistung. Mein Widerrufsrecht erlischt mit vollstndiger Ausfhrung.','For service contracts','I agree to the starting of the service and I acknowledge that I lose my right to cancel once the service has been fully performed.',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2017-12-21 11:27:11'),('29142e76dd32dd477.41262508','oxforgotpwd',1,1,0,1,1,'','Passwort vergessen','Sollten Sie innerhalb der nchsten Minuten KEINE E-Mail mit Ihren Zugangsdaten erhalten, so berprfen Sie bitte: Haben Sie sich in unserem Shop bereits registriert? Wenn nicht, so tun Sie dies bitte einmalig im Rahmen des Bestellprozesses. Sie knnen dann selbst ein Passwort festlegen. Sobald Sie registriert sind, knnen Sie sich in Zukunft mit Ihrer E-Mail-Adresse und Ihrem Passwort einloggen.\r\n<ul>\r\n<li class=\"font11\">Wenn Sie sich sicher sind, dass Sie sich in unserem Shop bereits registriert haben, dann berprfen Sie bitte, ob Sie sich bei der Eingabe Ihrer E-Mail-Adresse evtl. vertippt haben.</li></ul>\r\n<p>Sollten Sie trotz korrekter E-Mail-Adresse und bereits bestehender Registrierung weiterhin Probleme mit dem Login haben und auch keine \"Passwort vergessen\"-E-Mail erhalten, so wenden Sie sich bitte per E-Mail an: <a href=\"mailto:[{ $oxcmp_shop->oxshops__oxinfoemail->value }]?subject=Passwort\"><strong>[{ $oxcmp_shop->oxshops__oxinfoemail->value }]</strong></a></p>','Forgot password','<p>If you don\'t get an e-mail with your access data, please make sure that you have already registered with us. As soon as you are registered, you can login with your e-mail address and your password.</p>\r\n<ul>\r\n<li>\r\nIf you are sure you are already registered, please check the e-mail address you entered as user name.</li></ul>\r\n<p>\r\nIn case you still have problems logging in, please turn to us by e-mail: <a href=\"mailto:[{ $oxcmp_shop->oxshops__oxinfoemail->value }]?subject=Password\"><strong>[{ $oxcmp_shop->oxshops__oxinfoemail->value }]</strong></a></p>',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_EMAILS','','2017-12-21 11:27:11'),('2eb46767947d21851.22681675','oximpressum',1,1,0,1,1,'','Impressum','<p>Fgen Sie hier Ihre Anbieterkennzeichnung ein.</p>','About Us','<p>Add provider identification here.</p>',1,'','',0,'','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2017-12-21 11:27:11'),('2eb4676806a3d2e87.06076523','oxagb',1,1,0,1,1,'','AGB','<div><strong>AGB</strong></div>\r\n<div><strong>&nbsp;</strong></div>\r\n<div>Fgen Sie hier Ihre allgemeinen Geschftsbedingungen ein:</div>\r\n<div>&nbsp;</div>\r\n<div><span style=\"font-weight: bold\">Strukturvorschlag:</span><br>\r\n<br>\r\n<ol>\r\n<li>Geltungsbereich </li>\r\n<li>Vertragspartner </li>\r\n<li>Angebot und Vertragsschluss </li>\r\n<li>Widerrufsrecht, Widerrufsbelehrung, Widerrufsfolgen </li>\r\n<li>Preise und Versandkosten </li>\r\n<li>Lieferung </li>\r\n<li>Zahlung </li>\r\n<li>Eigentumsvorbehalt </li>\r\n<li>Gewhrleistung </li>\r\n<li>Weitere Informationen</li></ol></div>','Terms and Conditions','Insert your terms and conditions here.',1,'','',0,'','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','1','2017-12-21 11:27:11'),('3194668fde854d711.73798992','oxemailfooterplain',1,1,0,1,1,'','E-Mail Futext Plain','-- Bitte fgen Sie hier Ihre vollstndige Anbieterkennzeichnung ein.','E-mail footer plain','-- Please insert your imprint here.',1,'','',0,'','','30e44ab83fdee7564.23264141','CMSFOLDER_EMAILS','','2017-12-21 11:27:11'),('42e4667ffcf844be0.22563656','oxemailfooter',1,1,0,1