/a>, the trusted Open Source eCommerce company.</p>\r\n<h3>OXID eShop Community Edition</h3>\r\n<p>The Community Edition of OXID eShop is distributed under the terms and conditions of the GNU General Public License version 3 (GPLv3). Briefly summarized, the GPL gives you the right to use, modify and share this copy of OXID eShop. If you choose to share OXID eShop, you may only share it under the terms and conditions of the GPL. If you share a modified version of OXID eShop, these modifications must also be placed under the GPL. Read the complete <a href=\"http://www.gnu.org/licenses/gpl.txt\">legal terms and conditions of the GPL</a> or see <a href=\"http://www.oxid-esales.com/en/products/community-edition/gpl-v3-faq\">OXID\'s GPLv3 FAQ</a>.</p>\r\n<h3>OXID eShop Professional and Enterprise Edition</h3>\r\n<p>These OXID eShop editions are distributed under OXID Commercial Licenses. For more information, please <a href=\"http://www.oxid-esales.com/en/company/about-oxid-esales/contact\">contact OXID eSales</a>.</p>\r\n<h3>Third-party Software</h3>\r\n<p>This product includes certain free/open source software. A <a href=\"http://www.oxid-esales.com/en/company/about-oxid-esales/third-party-licenses\">complete list of third-party software included in OXID eShop</a> is publicly available.</p>\r\n<h3>Copyright Notice</h3>\r\n<p>Copyright  2003-2012 <a href=\"http://www.oxid-esales.com\">OXID eSales AG</a>, with portions copyright by other parties.</p>\r\n\r\n\r\n<!-- added by Marco //-->\r\n\r\n\r\n<h3>List of Contributions</h3>\r\n<ul>\r\n   <li><b>Downloadable Products</b>\r\n   <br>Some business models are based on downloadable virtual products like software, PDF or MP3 files instead of the classic shipment of products purchased in an online store. Please find more information on <a href=\"http://wiki.oxidforge.org/Features/Downloadable_products\" target=\"_blank\">OXIDforge</a>.\r\n   <br>contributed by <a href=\"http://www.marmalade.de\" target=\"_blank\">marmalade.de</a>\r\n   </li>\r\n\r\n\r\n   <li><b>Rich Snippets: RDFa + GoodRelations</b>\r\n   <br>We are convinced that the RDFa + GoodRelations vocabulary will be the future of rich snippets, especially for eCommerce. Please find more information on <a href=\"\" target=\"_blank\">OXIDforge</a>.\r\n   <br>contributed by Daniel Bingel and Prof. Dr. Hepp <a href=\"http://www.heppnetz.de/projects/goodrelations/\" target=\"_blank\">(GoodRelations)</a>.\r\n   </li>\r\n\r\n\r\n</ul>',1,'','',0,'','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2017-12-21 11:27:11'),('84a42e66105998a86.14045828','oxuserorderemailend',1,1,0,1,1,'','Ihre Bestellung Abschluss','<div align=\"left\">Fgen Sie hier Ihre Widerrufsbelehrung ein.</div>','your order terms','<p>Right to Withdrawal can be inserted here.</p>',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_EMAILS','','2017-12-21 11:27:11'),('84a42e66123887821.29772527','oxuserorderemailendplain',1,1,0,1,1,'','Ihre Bestellung Abschluss Plain','Fgen Sie hier Ihre Widerrufsbelehrung ein.','your order terms plain','<p>Right to Withdrawal can be inserted here.</p>',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_EMAILS','','2017-12-21 11:27:11'),('8709e45f31a86909e9f999222e80b1d0','oxstdfooter',1,1,0,1,1,'','Standard Footer','<div>OXID Online Shop - Alles rund um das Thema Wassersport, Sportbekleidung und Mode </div>','standard footer','<div>OXID Online Shop - All about watersports, sportswear and fashion </div>',1,'','',1,'','','30e44ab83fdee7564.23264141','','','2017-12-21 11:27:11'),('ad542e49541c1add','oxupdatepassinfoemail',1,1,0,1,1,'','Ihr Passwort im eShop','Hallo [{ $user->oxuser__oxsal->value|oxmultilangsal }] [{ $user->oxuser__oxfname->value }] [{ $user->oxuser__oxlname->value }],\r\n<br /><br />\r\nffnen Sie den folgenden Link, um ein neues Passwort fr [{ $shop->oxshops__oxname->value }] einzurichten:\r\n<br /><br />\r\n<a href=\"[{ $oViewConf->getBaseDir() }]index.php?cl=forgotpwd&amp;uid=[{ $user->getUpdateId() }