ain','<p>Here, you can insert additional information, further links, user manual etc. for the &quot;Help&quot;-function on <em>category pages</em>.</p>',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2017-12-21 11:27:11'),('c4241316b2e5c1966.96997013','oxhelpstart',1,1,0,1,1,'','Hilfe - Die Startseite','<p>Hier knnen zustzliche Informationen, weiterfhrende Links, Bedienungshinweise etc. fr die Hilfe-Funktion auf der <em>Startseite</em> eingefgt werden. </p>\r\n<p>&nbsp;</p>','Help - Start page','<p>Here, you can insert additional information, further links, user manual etc. for the &quot;Help&quot;-function on the <em>start page</em>.</p><br />',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2017-12-21 11:27:11'),('c4241316c6e7b9503.93160420','oxbargain',1,1,0,1,1,'','Angebot der Woche','<table>[{foreach from=$oView->getBargainArticleList() item=articlebargain_item}] <tbody><tr><td>\r\n<div class=\"product_image_s_container\"><a href=\"[{$articlebargain_item->getLink()}]\"><img border=\"0\" alt=\"[{ $articlebargain_item->oxarticles__oxtitle->value }][{if $articlebargain_item->oxarticles__oxvarselect->value }] [{ $articlebargain_item->oxarticles__oxvarselect->value }][{/if}] [{$oxcmp_shop->oxshops__oxtitlesuffix->value}]\" src=\"[{ $articlebargain_item->getDynImageDir()}]/[{$articlebargain_item->oxarticles__oxicon->value}]\"></a></div> </td><td class=\"boxrightproduct-td\"> <a href=\"[{$articlebargain_item->getLink()}]\" class=\"boxrightproduct-td\"><strong>[{ $articlebargain_item->oxarticles__oxtitle->value|cat:\"\r\n\"|cat:$articlebargain_item->oxarticles__oxvarselect->value|strip_tags|smartwordwrap:15:\"<br>\r\n\":2:1:\"...\" }]</strong></a><br>\r\n [{ if $articlebargain_item->isBuyable() }] <a href=\"[{$articlebargain_item->getToBasketLink()}]&amp;am=1\" class=\"details\" onclick=\"showBasketWnd();\" rel=\"nofollow\"><img border=\"0\" src=\"[{$oViewConf->getImageUrl(\'arrow_details.gif\')}]\" alt=\"\"> Jetzt bestellen