nformation:</span></strong> Currently, there is no shipping method defined for your country. We will find a method to deliver the goods you purchased and will inform you as soon as possible.</p>\r\n<p>If you have any requests, don\'t hesitate to contact us! [{ $shop->oxshops__oxorderemail->value }]</p>',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_EMAILS','','2017-12-21 11:27:11'),('c8d45408c4998f421.15746968','oxadminordernpemail',1,1,0,1,1,'','Ihre Bestellung Admin (Fremdlnder)','<div>\r\n<p> <span style=\"color: #ff0000;\"><strong>Hinweis:</strong></span> Derzeit ist keine Liefermethode fr dieses Land bekannt. Bitte Liefermglichkeiten suchen und den Besteller unter Angabe der <strong>Lieferkosten</strong> informieren!\r\n&nbsp;</p> </div>\r\n<div>Folgende Artikel wurden soeben unter [{ $shop->oxshops__oxname->value }] bestellt:<br>\r\n<br>\r\n</div>','your order admin (other country)','<p> <span style=\"color: #ff0000\"><strong>Information:</strong></span> Currently, there is no shipping method defined for this country. Please find a delivery option and inform the customer about the <strong>shipping costs</strong>.</p>\r\n<p>The following products have been ordered on [{ $shop->oxshops__oxname->value }]:<br />\r\n<br /></p>',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_EMAILS','','2017-12-21 11:27:11'),('c8d45408c5c39ea22.75925645','oxuserordernpplainemail',1,1,0,1,1,'','Ihre Bestellung (Fremdlnder) Plain','Vielen Dank fr Ihre Bestellung!\r\n\r\nHinweis: Derzeit ist uns keine Versandmethode fr dieses Land bekannt. Wir werden versuchen, Versandmethoden zu finden und Sie ber das Ergebnis unter Angabe der Versandkosten informieren.\r\n\r\nBei Fragen sind wir jederzeit fr Sie da: Schreiben Sie einfach an [{ $shop->oxshops__oxorderemail->value }]!','your order plain (other country)','Thank you for your order!\r\nInformation: Currently, there is no shipping method defined for your country. We will find a method to deliver the goods you purchased and will inform you as soon as possible.\r\n\r\nIf you have any requests don\'t hesitate to contact us! [{ $shop->oxshops__oxorderemail->value }]',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_EMAILS','','2017-12-21 11:27:11'),('c8d45408c718782f3.21298666','oxadminordernpplainemail',1,1,0,1,1,'','Ihre Bestellung Admin (Fremdlnder) Plain','Hinweis: Derzeit ist keine Liefermethode fr dieses Land bekannt. Bitte Liefermglichkeiten suchen und den Besteller informieren!\r\n\r\nFolgende Artikel wurden soeben unter [{ $shop->oxshops__oxname->getRawValue() }] bestellt:','your order admin plain (other country)','<p>Information: Currently, there is no shipping method defined for this country. Please find a delivery option and inform the customer about the shipping costs.\r\n\r\nThe following products have been ordered on [{ $shop->oxshops__oxname->getRawValue() }]:</p>',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_EMAILS','','2017-12-21 11:27:11'),('ce77743c334edf92b0cab924a7','oxstartmetakeywords',1,1,0,1,1,'','META Keywords Startseite','kite, kites, kiteboarding, kiteboards, wakeboarding, wakeboards, boards, strand, sommer, wassersport, mode, fashion, style, shirts, jeans, accessoires, angebote','META keywords start page','kite, kites, kiteboarding, kiteboards, wakeboarding, wakeboards, boards, beach, summer, watersports, funsports, fashion, style, shirts, jeans, accessories, special offers',1,'','',1,'','','30e44ab83fdee7564.23264141','','','2017-12-21 11:27:11'),('ce79015b6f6f07612270975889','oxstartmetadescription',1,1,0,1,1,'','META Description Startseite','Alles zum Thema Wassersport, Sportbekleidung und Mode. Umfangreiches Produktsortiment mit den neusten Trendprodukten. Blitzschneller Versand.<br />','META description start page','<p>All about watersports, sportswear and fashion. Extensive product range including several trendy products. Fast shipping.</p>\r\n<p>&nbsp;</p>',1,'','',1,'','','30e44ab83fdee7564.23264141','','','2017-12-21 11:27:11'),('d0f7ac8b29909908dc20d854224944fe','oxnopaymentmethod',1,1,0,1,1,'','No payment method text','<p>Derzeit ist keine Versandart fr dieses Land\r\ndefiniert.</p>\r\n<p>Wir werden versuchen, Liefermglichkeiten zu\r\nfinden und Sie ber die Versandkosten informieren.</p>','No payment method text','<p>Currently we have no shipping method set up\r\nfor this country.</p>\r\n<p>We are aiming to find a possible delivery\r\nmethod and we will inform you as soon as possible via e-mail about the result,\r\nincluding further information about delivery costs.</p>',0,'','',0,'','','30e44ab83fdee7564.23264141','','','2017-12-21 11:27:11'),('d74fdc1ed22a0d469bdcc5f003ca6575','oxregistrationdescription',1,1,0,1,1,'','Registration Description','<p>Mit einem persnlichen Kundenkonto haben Sie folgende Vorteile:<br />\r\n - Verwaltung der Lieferadressen<br />\r\n - Prfung des Bestellstatus<br />\r\n - Bestellhistorie<br />\r\n - persnlicher Merkzettel<br />\r\n - persnliche Wunschliste<br />\r\n - Newsletter-Verwaltung<br />\r\n - Sonder- und Rabattaktionen</p>','Registration Description','<p>A customer with an account has advantages like:<br />\r\n - Administration of shipping addresses<br />\r\n - Check order status<br />\r\n - Order History<br />\r\n - Personal Wish List<br />\r\n - Personal Gift Registry<br />\r\n - Newsletter subscription<br />\r\n - Special offers and discounts</p>',0,'','',0,'','','30e44ab83fdee7564.23264141','','','2017-12-21 11:27:11'),('f41427a07519469f1.34718981','oxdeliveryinfo',1,1,0,1,1,'','Zahlung und Lieferung','<p>Fgen Sie hier Ihre Versandinformationen- und kosten ein.</p>','Shipping and Charges','<p>Add your shipping information and costs here.</p>',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2017-12-21 11:27:11'),('f41427a099a603773.44301043','oxsecurityinfo',1,1,0,1,1,'','Datenschutz','Fgen Sie hier Ihre Datenschutzbestimmungen ein.','Privacy Policy','Enter your privacy policy here.',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2017-12-21 11:27:11'),('f41427a10afab8641.52768563','oxnewstlerinfo',1,1,0,1,1,'','Neuigkeiten bei uns','<div>Mit dem [{ $oxcmp_shop->oxshops__oxname->value }]-Newsletter alle paar Wochen. <br>\r\nMit Tipps, Infos, Aktionen ... <br>\r\n<br>\r\nDas Abo kann jederzeit durch Austragen der E-Mail-Adresse beendet werden. <br>\r\nEine <span class=\"newsletter_title\">Weitergabe Ihrer Daten an Dritte lehnen wir ab</span>. <br>\r\n<br>\r\nSie bekommen zur Besttigung nach dem Abonnement eine E-Mail - so stellen wir sicher, dass kein Unbefugter Sie in unseren Newsletter eintragen kann (sog. \"Double Opt-In\").<br>\r\n<br>\r\n</div>','newsletter info','<p>Stay in touch with the periodic [{ $oxcmp_shop->oxshops__oxname->value }]-newsletter every couple of weeks. We gladly inform you about recent tips, promotions and new products.</p>\r\n<p>You can unsubscribe any time from the newsletter.</p>\r\n<p>We strictly refuse <span class=\"newsletter_title\">transferring your data to 3rd parties</span>.</p>\r\n<p>For subscription we use the so called &quot;double opt-in&quot; procedure to guarantee that no unauthorized person will register with your e-mail address.</p>',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2017-12-21 11:27:11');
