INSERT INTO `oxnewsletter` VALUES ('oxidnewsletter',1,'Beispiel Newsletter','<!DOCTYPE HTML>\r\n<html>\r\n  <head>\r\n      <title>OXID eSales Newsletter</title>\r\n  </head>\r\n\r\n  <body bgcolor=\"#ffffff\" link=\"#355222\" alink=\"#18778E\" vlink=\"#389CB4\" style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">\r\n\r\n    <div width=\"600\" style=\"width: 600px\">\r\n\r\n        <div style=\"padding: 10px 0;\">\r\n            <img src=\"[{$oViewConf->getImageUrl(\'logo_email.png\', false)}]\" border=\"0\" hspace=\"0\" vspace=\"0\" alt=\"[{ $shop->oxshops__oxname->value }]\" align=\"texttop\">\r\n        </div>\r\n        \r\n        <p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">\r\n            Hallo [{ $myuser->oxuser__oxsal->value|oxmultilangsal }] [{ $myuser->oxuser__oxfname->value }] [{ $myuser->oxuser__oxlname->value }],\r\n        </p>\r\n        \r\n        <p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">\r\n            wie Sie sehen knnen, funktioniert unser Newsletter richtig gut.\r\n        </p>\r\n\r\n        <p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">\r\n            Nicht nur, dass wir hier Ihre Adresse ausgeben knnen:\r\n        </p>\r\n\r\n        <p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; padding-left: 20px;\">\r\n            [{ $myuser->oxuser__oxaddinfo->value }]<br>\r\n            [{ $myuser->oxuser__oxstreet->value }]<br>\r\n            [{ $myuser->oxuser__oxzip->value }] [{ $myuser->oxuser__oxcity->value }]<br>\r\n            [{ $myuser->oxuser__oxcountry->value }]<br>\r\n            Telefon: [{ $myuser->oxuser__oxfon->value }]<br>\r\n        </p>\r\n\r\n        <p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">\r\n            sondern wir knnen noch viel mehr!<br><br>\r\n            Sie wollen diesen Newsletter nicht mehr erhalten? Kein Problem - klicken Sie einfach <a href=\"[{ $oViewConf->getBaseDir() }]index.php?cl=newsletter&amp;fnc=removeme&amp;uid=[{$myuser->oxuser__oxid->value}]\" style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px;\" target=\"_blank\">hier</a>.<br>\r\n        </p>\r\n\r\n        [{if isset($simarticle0) }]\r\n            <h3 style=\"font-weight: bold; margin: 20px 0 7px; padding: 0; line-height: 35px; font-size: 12px;font-family: Arial, Helvetica, sans-serif; text-transform: uppercase; border-bottom: 4px solid #ddd;\">\r\n                Ein hnlicher Artikel zu Ihrer letzten Bestellung:\r\n            </h3>\r\n\r\n            <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%; padding-bottom: 10px; margin-bottom: 20px; border-bottom: 2px solid #ddd;\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td valign=\"top\" style=\"padding-right: 25px;\">\r\n                            <a href=\"[{$simarticle0->getLink()}]\"><img alt=\"[{ $simarticle0->oxarticles__oxtitle->value }]\" src=\"[{$simarticle0->getThumbnailUrl()}]\" border=\"0\" hspace=\"0\" vspace=\"0\"></a>\r\n                        </td>\r\n                        <td valign=\"top\">\r\n                            <h4 style=\"font-size: 14px; font-weight: bold; margin: 0 0 15px;\">[{ $simarticle0->oxarticles__oxtitle->value }]</h4>\r\n                            <p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">\r\n                                [{ $simarticle0->oxarticles__oxshortdesc->value }]\r\n                            </p>\r\n                            <p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; margin: 0;\">\r\n                                <b>Statt <s>[{ $simarticle0->getFTPrice()}]</s></b>\r\n                                jetzt nur <span style=\"font-size: 14px;\"><b>[{ $simarticle0->getFPrice() }] [{ $mycurrency->sign}]</b></span>\r\n                                <br><br>\r\n                                <a href=\"[{$simarticle0->getLink()}]\">mehr Infos</a>\r\n                            </p>\r\n                        </td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n        [{/if}]\r\n        \r\n        [{if isset($simarticle1) }]\r\n            <p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">\r\n                Auch das hier ist ein hnlicher Artikel zu Ihrer letzten Bestellung:\r\n            </p>\r\n            \r\n            <h3 style=\"font-weight: bold; margin: 10px 0 7px; padding: 0; line-height: 35px; font-size: 12px;font-family: Arial, Helvetica, sans-serif; text-transform: uppercase; border-bottom: 4px solid #ddd;\">\r\n                Top Angebot der Woche\r\n            </h3>\r\n\r\n            <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%; padding-bottom: 10px; margin-bottom: 20px;  border-bottom: 2px solid #ddd;\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td valign=\"top\" style=\"padding-right: 25px;\">\r\n                            <a href=\"[{$simarticle1->getLink()}]\"><img alt=\"[{ $simarticle1->oxarticles__oxtitle->value }]\" src=\"[{$simarticle1->getThumbnailUrl()}]\" border=\"0\" hspace=\"0\" vspace=\"0\"></a>\r\n                        </td>\r\n                        <td valign=\"top\">\r\n                            <h4 style=\"font-size: 14px; font-weight: bold; margin: 0 0 15px;\">[{ $simarticle1->oxarticles__oxtitle->value }]</h4>\r\n                            <p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">\r\n                                [{ $simarticle0->oxarticles__oxshortdesc->value }]\r\n                            </p>\r\n                            <p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; margin: 0;\">\r\n                                Jetzt nur <span style=\"font-size: 14px;\"><b>[{ $simarticle1->getFPrice() }] [{ $mycurrency->sign}] !!!</b></span>\r\n                                <br><br>\r\n                                <a href=\"[{$simarticle1->getLink()}]\">mehr Infos</a>\r\n                            </p>\r\n                        </td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n        [{/if}]\r\n\r\n        [{if isset($simarticle2) }]\r\n            <p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">\r\n                Und zuletzt nochmal ein hnlicher Artikel zu Ihrer letzten Bestellung:\r\n            </p>\r\n\r\n            <h3 style=\"font-weight: bold; margin: 10px 0 7px; padding: 0; line-height: 35px; font-size: 12px;font-family: Arial, Helvetica, sans-serif; text-transform: uppercase; border-bottom: 4px solid #ddd;\">\r\n                Schnppchen!\r\n            </h3>\r\n\r\n            <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%; padding-bottom: 10px; margin-bottom: 20px; border-bottom: 2px solid #ddd;\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td>\r\n                            <p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">\r\n                                Jetzt gibt es unseren Bestseller <a href=\"[{$simarticle2->getLink()}]\">[{ $simarticle2->oxarticles__oxtitle->value }]</a> in der gnstigen Sonderausgabe exklusiv bei OXID!<br>\r\n                            </p>\r\n                            <p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">\r\n                                <a href=\"[{$simarticle2->getToBasketLink()}]&amp;am=1\">Gleich bestellen</a>!\r\n                            </p>\r\n                        </td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n        [{/if}]\r\n\r\n\r\n        [{if isset($articlelist) }]\r\n\r\n            <h3 style=\"font-weight: bold; margin: 10px 0 7px; padding: 0; line-height: 35px; font-size: 12px;font-family: Arial, Helvetica, sans-serif; text-transform: uppercase; border-bottom: 4px solid #ddd;\">\r\n                Ausgesuchte Artikel aus unserem Shop extra fr diesen Newsletter:\r\n            </h3>\r\n        \r\n            [{foreach from=$articlelist item=product}]\r\n                <table cellspacing=\"0\" cellpadding=\"0\" border=\"0\" align=\"left\" style=\"width: 220px; margin-right: 15px; margin-bottom: 10px; border: 1px solid #ccc; padding: 10px;\">\r\n                    <tr>\r\n                        <td align=\"center\">\r\n                            <a href=\"[{$product->getLink()}]\" class=\"startpageProduct\"><img vspace=\"0\" hspace=\"0\" border=\"0\" alt=\"[{ $product->oxarticles__oxtitle->value }]\" src=\"[{$product->getThumbnailUrl()}]\"></a>\r\n                        </td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>\r\n                            <p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; margin: 5px;\">\r\n                                <b>[{ $product->oxarticles__oxtitle->value }]</b>\r\n                            </p>\r\n                        </td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td height=\"20\">\r\n                            <p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; margin: 5px;\">\r\n                                Jetzt nur <b>[{ $product->getFPrice() }] [{ $mycurrency->sign}]</b>\r\n                            </p>\r\n                        </td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td height=\"20\">\r\n                            <a href=\"[{$product->getLink()}]\" class=\"startpageProductText\" style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; margin: 5px;\">mehr Infos</a><br>\r\n                        </td>\r\n                    </tr>\r\n                </table>\r\n            [{/foreach}]\r\n        [{/if}]\r\n\r\n        <div style=\"clear: both; height: 3px;\">&nbsp;</div>\r\n        \r\n        <div style=\"border: 1px solid #3799B1; margin: 30px 0 15px 0; padding: 12px 20px; background-color: #eee; border-radius: 4px 4px 4px 4px; linear-gradient(center top , #FFFFFF, #D1D8DB) repeat scroll 0 0 transparent;\">\r\n            <p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; margin: 0; padding: 0;\">\r\n                [{ oxcontent ident=\"oxemailfooter\" }]\r\n            </p>\r\n        </div>\r\n\r\n    </div>\r\n\r\n  </body>\r\n</html>','OXID eSales Newsletter\r\n\r\nHallo, [{ $myuser->oxuser__oxsal->value|oxmultilangsal }] [{ $myuser->oxuser__oxfname->getRawValue() }] [{ $myuser->oxuser__oxlname->getRawValue() }],\r\n\r\nwie Sie sehen knnen, funktioniert unser Newsletter-Modul richtig gut.\r\n\r\nNicht nur, dass wir hier Ihre Adresse ausgeben knnen:\r\n\r\n[{ $myuser->oxuser__oxaddinfo->getRawValue() }]\r\n[{ $myuser->oxuser__oxstreet->getRawValue() }]\r\n[{ $myuser->oxuser__oxzip->value }] [{ $myuser->oxuser__oxcity->getRawValue() }]\r\n[{ $myuser->oxuser__oxcountry->getRawValue() }]\r\nTelefon: [{ $myuser->oxuser__oxfon->value }]\r\n\r\nsondern wir knnen noch viel mehr!\r\n\r\nSie wollen diesen Newsletter nicht mehr erhalten? Kein Problem - klicken Sie einfach hier:\r\n[{$oViewConf->getBaseDir()}]index.php?cl=newsletter&fnc=removeme&uid=[{ $myuser->oxuser__oxid->value}]\r\n\r\n[{if isset($simarticle0) }]\r\n   Ein hnlicher Artikel zu Ihrer letzten Bestellung ist:\r\n \r\n    [{ $simarticle0->oxarticles__oxtitle->getRawValue() }] \r\n Statt [{ $simarticle0->getFTPrice()}] jetzt nur [{ $simarticle0->getFPrice() }] [{ $mycurrency->name}]\r\n[{/if}]\r\n\r\n[{if isset($articlelist) }]\r\n  Ausgesuchte Artikel aus unserem Shop extra fr diesen Newsletter: \r\n     [{foreach from=$articlelist item=product}]  \r\n        [{ $product->oxarticles__oxtitle->getRawValue() }]   Jetzt nur [{ $product->getFPrice() }] [{ $mycurrency->name}]\r\n    [{/foreach}] \r\n[{/if}]           \r\n     \r\n','Newsletter subject','2017-12-21 11:27:11');
/*!40000 ALTER TABLE `oxnewsletter` ENABLE KEYS */;
UNLOCK TABLES;

